INSERT INTO `catalogsearch_fulltext` (`fulltext_id`, `product_id`, `store_id`, `data_index`) VALUES
(26512, 56, 7, 'bag8|WorldCorp|Red|Enabled|Taxable Goods|Orange Shopper|One of the first things you are required to do when adding a new product to your catalog is to specify the product type. Magento’s product catalog is based upon six product types, which are divided into two groups which can be called “Simple” and “Complex.” In this case, the word “complex” conveys the meaning of compound, or one-to-many. A Simple product is a physical item with a single SKU. Simple products have a variety of pricing and input controls, which makes it possible to sell many variations of a product. Simple products can be used in association with Bundle, Grouped and Configurable Products. To create a Simple Product the first step is to choose the attribute set, which determines the fields that are included in the product record. The product can be based on the Default attribute set, which includes the standard set of fields used by most products.|There are many different product types in Magento. The Simple Product type should be used for that generally have a single configuration (one-size-fits-all). Every product can also have additional options.|120.55|1'),
(26513, 57, 7, 'bag9|WorldCorp|Red|Enabled|Taxable Goods|Neat Stripes Bag|One of the first things you are required to do when adding a new product to your catalog is to specify the product type. Magento’s product catalog is based upon six product types, which are divided into two groups which can be called “Simple” and “Complex.” In this case, the word “complex” conveys the meaning of compound, or one-to-many. A Simple product is a physical item with a single SKU. Simple products have a variety of pricing and input controls, which makes it possible to sell many variations of a product. Simple products can be used in association with Bundle, Grouped and Configurable Products. To create a Simple Product the first step is to choose the attribute set, which determines the fields that are included in the product record. The product can be based on the Default attribute set, which includes the standard set of fields used by most products.|There are many different product types in Magento. The Simple Product type should be used for that generally have a single configuration (one-size-fits-all). Every product can also have additional options.|120.55|1'),
