(26633, 59, 9, 'bag11|WorldCorp|Yellow|Enabled|Taxable Goods|Lemon Leather Clutch|One of the first things you are required to do when adding a new product to your catalog is to specify the product type. Magento’s product catalog is based upon six product types, which are divided into two groups which can be called “Simple” and “Complex.” In this case, the word “complex” conveys the meaning of compound, or one-to-many. A Simple product is a physical item with a single SKU. Simple products have a variety of pricing and input controls, which makes it possible to sell many variations of a product. Simple products can be used in association with Bundle, Grouped and Configurable Products. To create a Simple Product the first step is to choose the attribute set, which determines the fields that are included in the product record. The product can be based on the Default attribute set, which includes the standard set of fields used by most products.|There are many different product types in Magento. The Simple Product type should be used for that generally have a single configuration (one-size-fits-all). Every product can also have additional options.|45.99|1'),
(26503, 44, 7, 'ebook1|Enabled|Taxable Goods|Publisher|Sample eBook|Magento offers the ability to sell downloads. You can create number of links for every Downloadable Product. Downloadable files can be located on your server or can be provided as URLs to any other server. Files can either be uploaded through the admin panel, or by uploading directly to the server via FTP and then added by URL. When a customer buys a Downloadable Product, product can be downloaded after logging in to the Customer Account. Magento will generate a secure, encrypted link for that customer to download the file (customer can''t see the file''s real location). A link can also be set to be shareable - it will be accessible without the requirement of logging in.|Magento offers the ability to sell downloads. This is great for software, digital music files, and other electronic products.|25|Magento Themes - The Ultimate User Guide|Magento Themes - Bonus Chapter|Click to download sample chapter|You can show your customers any number of samples|1'),
(26587, 72, 8, 'headphones4|Enabled|Soundwave|Taxable Goods|Dark Blue|Soundwave Headset Pro|The product edit panel in Magento provides access to the full range of settings which make up a product record. The information in this section can be used for reference when creating a product of any type. The selection of tabs in the Product Information panel, and the organization of the fields on each tab is determined by the attribute set that was used to create the product. One of the first things you are required to do when adding a new product to your catalog is to specify the product type. Here are some selected options of Catalog Management offered by Magento: Inventory Management with Backordered items, Minimum and Maximum quantities Simple, Configurable (e.g. size, color, etc.), Bundled and Grouped Products Downloadable/Digital Products, Virtual Products Customer Personalized Products - upload text for embroidery, monogramming, etc. Create Store-specific attributes on the fly Tax Rates per location, customer group and product type Advanced Pricing Rules and support for Special Prices (see marketing tools) Attribute Sets for quick product creation of different item types Media Manager with automatic image resizing and watermarking Search Results rewrites and redirects Approve, Edit and Delete Product Reviews and Tags RSS feed for Low Inventory Alerts Batch Import and Export of catalog Batch Updates to products in admin panel|There are many different product types in Magento. The Simple Product type should be used for that generally have a single configuration. Every product can also have additional options.|149|1'),
