(26563, 45, 8, 'ebook2|Enabled|Publisher|Taxable Goods|eBook + Free Chapters|Magento offers the ability to sell downloads. You can create number of links for every Downloadable Product. Downloadable files can be located on your server or can be provided as URLs to any other server. Files can either be uploaded through the admin panel, or by uploading directly to the server via FTP and then added by URL. When a customer buys a Downloadable Product, product can be downloaded after logging in to the Customer Account. Magento will generate a secure, encrypted link for that customer to download the file (customer can''t see the file''s real location). A link can also be set to be shareable - it will be accessible without the requirement of logging in.|Magento offers the ability to sell downloads. This is great for software, digital music files, and other electronic products.|30|Chapter 1|Chapter 2|Chapter 3|Chapter 4|Chapter 5|Bonus Chapter|Click to download free sample|You can show your customers any number of samples|Another sample|1'),
