(28220, 82, 2, 'blu-cherry|Blu|Black|Enabled|Taxable Goods|High|Cherry Crush Pack|A burst of Black Cherry swaddled in Maraschino undertones and blended with the dark mahogany blush of juicy Bing cherries, Cherry Crush is a tantalizingly tangy, potent, punchy and sweet addition to the line-up of blu e-cig flavors. Let Cherry Crush spark your senses with a dazzling trio of classic cherry flavors. Cherry Crush is the e-cigarette flavor that cherries aspire to be a part of.|Compatible with the blu Starter Pack, Premium and Original. Not for use with Premium100.|11.5|1'),
(28221, 84, 2, 'njoy-refills|Enabled|NJOY|Taxable Goods|Traditional|1.8%|NJOY Cartridge Refills|NJOY Cartridge Refills are now easier than ever to buy online. We offer free shipping and each pack of cartridge refills is equal to 1 carton of cigarettes. Buy NJOY, and get started today. The NJOY Traditional Electronic Cigarette Cartridge Refill package includes: 5 Traditional Flavor Electronic Cigarette Cartridges in each bottle Available in a variety of Nicotine Levels (1.8%, 1.2% and 0.6%) 1 NJOY Electronic Cigarette User Guide|NJOY Cartridge Refills are now easier than ever to buy online. We offer free shipping and each pack of cartridge refills is equal to 1 carton of cigarettes. Buy NJOY, and get started today.|19.99|1'),
(28222, 85, 2, 'mistic-refill|Enabled|Mistic|Taxable Goods|Mistic 0% Menthol Cartridges 3 pack Bundle|0% Menthol Cartridges - 3 pack Bundle 15 Total Cartridges Menthol Flavor 0% Nicotine by Volume|0% Menthol Cartridges - 3 pack Bundle|37.99|1'),
(28223, 86, 2, 'krave|Enabled|Krave|Taxable Goods|Traditional|High|KRAVE® KING - 5 Refill Filters for Rechargeable Electronic Cigarette|5 HIGH-CAPACITY REFILL FILTERS PER PACKAGE&nbsp; IN ORIGINAL TOBACCO &amp; MENTHOL FLAVORS&nbsp; ATOMIZED ALL-IN-ONE TECHNOLOGY FOR BEST EXPERIENCE&nbsp; EACH FILTER LASTS UP TO 160 PUFFS&nbsp; AVAILABLE IN 1.4% &amp; 1.8% NICOTINE STRENGTH&nbsp; TRADITIONAL WHITE FINISH WITH COLORED FLAVOR RING|5 HIGH-CAPACITY REFILL FILTERS PER PACKAGE|9.99|1'),
(28224, 87, 2, 'krave-menthol-bold|Enabled|Krave|Taxable Goods|FIN PACK OF 5 CARTOMIZERS MENTHOL - BOLD|The pack comes with 5 individual cartomizers&nbsp; Each cartomizer is the equivalent of nearly 2 packs of traditional cigarettes&nbsp; 2.4% Nicotine by volume INGREDIENTS: Propylene Glycol, Glycerin, Nicotine, Peppermint Oil, Vanillin, Menthyl Acetate, Carvone Laevo, Menthone Racemic, Menthol Crystals Natural, Ethyl Menthane Carboxamide.|The pack comes with 5 individual cartomizers of 2.4% Nicotine, Bold Menthol flavor.|14.99|1'),
(28225, 88, 2, 'LOGIC Cartomizers (Platinum, Black, & Gold Labels)|Enabled|Logic|Taxable Goods|2.4%|Tobacco|LOGIC Cartomizers (Platinum, Black, & Gold Labels)|LOGIC cartomizers deliver the same taste as our disposable line. Each cartomizer contains 400 puffs (equals to 2 packs of cigarettes) therefore since 5 come in 1 pack, each pack is equivalent to 1 carton of cigarettes. Platinum cartomizers come in your choice of Tobacco or Menthol.|LOGIC Cartomizers In Your Choice Of Platinum, Black, Or Gold Labels|21.99|1'),
(28226, 89, 2, 'FlavorMax Cartomizers|Enabled|GreenSmoke|Taxable Goods|Absolute Tobacco|Strong (2.4%)|Green Smoke FlavorMax Cartomizers|FlavorMax&trade; Cartomizers are among the longest lasting cartomizers available and give you 25% more vapor than other leading brands. You can pull up to 360 puffs from each cartomizer which is comparable to up to 1.5 packs of traditional cigarettes. FlavorMax&trade; Cartomizers are also triple sealed ensuring that you get the freshest, fullest flavor with every puff.|FlavorMax&trade; Cartomizers &ndash; longer, fresher, better. The next level in smoking.|16.49|1'),
(28218, 80, 2, 'blu01|Enabled|Blu|Taxable Goods|High|Black|Blu Classic Tobacco Pack|Nothing tops a classic. Classic Tobacco is the original blu e-cig flavor: a carefully crafted, proprietary blend of Burley and Brightleaf tobacco flavors. Then, the flavor of flue-cured Cavendish is added to the mix, bringing out the natural sweetness. For those who enjoy the taste and feel of a rich, full-flavored tobacco cigarette, Classic has you covered. It IS the electric cigarette flavor cartridge of choice.|Compatible with the blu Starter Pack, Premium and Original. Not for use with Premium100.|11.5|1'),
(28219, 81, 2, 'blu-menthol|Enabled|Blu|Taxable Goods|Natural|High|Magnificent Menthol Pack|Cool. Refreshing. Striking, yet subdued. Our Magnificent Menthol flavor cartridges deliver an aromatic, sub-zero surge of icy-cold tranquility. A delightful fusion of peppermint, spearmint and natural menthol crystals flavors are sure to please. Just one puff will keep you as chill as an arctic wind.|Compatible with the blu Starter Pack, Premium and Original. Not for use with Premium100.|11.5|1'),
(26470, 73, 6, 'headphones5|Enabled|Soundwave|Taxable Goods|Black|Mobile Stereo Earphones|The product edit panel in Magento provides access to the full range of settings which make up a product record. The information in this section can be used for reference when creating a product of any type. The selection of tabs in the Product Information panel, and the organization of the fields on each tab is determined by the attribute set that was used to create the product. One of the first things you are required to do when adding a new product to your catalog is to specify the product type. Here are some selected options of Catalog Management offered by Magento: Inventory Management with Backordered items, Minimum and Maximum quantities Simple, Configurable (e.g. size, color, etc.), Bundled and Grouped Products Downloadable/Digital Products, Virtual Products Customer Personalized Products - upload text for embroidery, monogramming, etc. Create Store-specific attributes on the fly Tax Rates per location, customer group and product type Advanced Pricing Rules and support for Special Prices (see marketing tools) Attribute Sets for quick product creation of different item types Media Manager with automatic image resizing and watermarking Search Results rewrites and redirects Approve, Edit and Delete Product Reviews and Tags RSS feed for Low Inventory Alerts Batch Import and Export of catalog Batch Updates to products in admin panel|There are many different product types in Magento. The Simple Product type should be used for that generally have a single configuration. Every product can also have additional options.|45|1'),
