(26613, 35, 9, 'top1|Brandissimi|Blue|Enabled|Taxable Goods|Product with Variants|Custom Variants and Options let you create product customization options and fields quickly and easily. Any product can have custom variants and options &ndash; this can be configured in its product configuration. Custom variants and options can be created for products as required or non-required options. They can affect the total price of the product by a fixed amount or percentage. In other words, custom variants and options allow you to make products that are unique and individualized. Whether it&rsquo;s a gift with a special message, a sweatshirt with custom embroidered text, or anything in between &ndash; possibilities are limitless.|Custom Variants and Options let you create product customization options and fields quickly and easily. Any product can have custom options.|40|1'),
