(26471, 74, 6, 'headphones6|Enabled|Soundwave|Taxable Goods|Red|Small Universal Earphones|The product edit panel in Magento provides access to the full range of settings which make up a product record. The information in this section can be used for reference when creating a product of any type. The selection of tabs in the Product Information panel, and the organization of the fields on each tab is determined by the attribute set that was used to create the product. One of the first things you are required to do when adding a new product to your catalog is to specify the product type. Here are some selected options of Catalog Management offered by Magento: Inventory Management with Backordered items, Minimum and Maximum quantities Simple, Configurable (e.g. size, color, etc.), Bundled and Grouped Products Downloadable/Digital Products, Virtual Products Customer Personalized Products - upload text for embroidery, monogramming, etc. Create Store-specific attributes on the fly Tax Rates per location, customer group and product type Advanced Pricing Rules and support for Special Prices (see marketing tools) Attribute Sets for quick product creation of different item types Media Manager with automatic image resizing and watermarking Search Results rewrites and redirects Approve, Edit and Delete Product Reviews and Tags RSS feed for Low Inventory Alerts Batch Import and Export of catalog Batch Updates to products in admin panel|There are many different product types in Magento. The Simple Product type should be used for that generally have a single configuration. Every product can also have additional options.|54.99|1'),
(26488, 24, 7, 'phone3|Enabled|Enabled|Enabled|Enabled|Enabled|Company|Company|Company|Company|Company|Taxable Goods|Taxable Goods|Taxable Goods|Taxable Goods|Taxable Goods|Configurable Phone|Configurable Phone Example (Black)|Configurable Phone Example (Dark Blue)|Configurable Phone Example (Violet)|Configurable Phone Example (White)|Configurable Products let your customers select the variant they desire by choosing options. For example, you sell t-shirts in two colors and three sizes. You&rsquo;d create the six variants as individual products (with their own skus) and then add these six to a configurable product from where customers can choose size and color, then add to cart. If desired you could also have customers search for &ldquo;red medium t-shirt&rdquo; and land on the specific page for this variant. Complex products in Magento are a way to consolidate product variants onto a single product info page in the front-end. The variants themselves are actually simple products and have their own SKUs and stock management. This is very powerful - it allows you to let customers search for the individual variants, but browse only to the consolidated product pages.|Configurable Products let your customers select the variant they desire by choosing options. For example, you sell t-shirts in two colors and three sizes. You&rsquo;d create the six variants as individual products (with their own skus) and then add these six to a configurable product from where customers can choose size and color, then add to cart. If desired you could also have customers search for &ldquo;red medium t-shirt&rdquo; and land on the specific page for this variant. Complex products in Magento are a way to consolidate product variants onto a single product info page in the front-end. The variants themselves are actually simple products and have their own SKUs and stock management. This is very powerful - it allows you to let customers search for the individual variants, but browse only to the consolidated product pages.|Configurable Products let your customers select the variant they desire by choosing options. For example, you sell t-shirts in two colors and three sizes. You&rsquo;d create the six variants as individual products (with their own skus) and then add these six to a configurable product from where customers can choose size and color, then add to cart. If desired you could also have customers search for &ldquo;red medium t-shirt&rdquo; and land on the specific page for this variant. Complex products in Magento are a way to consolidate product variants onto a single product info page in the front-end. The variants themselves are actually simple products and have their own SKUs and stock management. This is very powerful - it allows you to let customers search for the individual variants, but browse only to the consolidated product pages.|Configurable Products let your customers select the variant they desire by choosing options. For example, you sell t-shirts in two colors and three sizes. You&rsquo;d create the six variants as individual products (with their own skus) and then add these six to a configurable product from where customers can choose size and color, then add to cart. If desired you could also have customers search for &ldquo;red medium t-shirt&rdquo; and land on the specific page for this variant. Complex products in Magento are a way to consolidate product variants onto a single product info page in the front-end. The variants themselves are actually simple products and have their own SKUs and stock management. This is very powerful - it allows you to let customers search for the individual variants, but browse only to the consolidated product pages.|Configurable Products let your customers select the variant they desire by choosing options. For example, you sell t-shirts in two colors and three sizes. You&rsquo;d create the six variants as individual products (with their own skus) and then add these six to a configurable product from where customers can choose size and color, then add to cart. If desired you could also have customers search for &ldquo;red medium t-shirt&rdquo; and land on the specific page for this variant. Complex products in Magento are a way to consolidate product variants onto a single product info page in the front-end. The variants themselves are actually simple products and have their own SKUs and stock management. This is very powerful - it allows you to let customers search for the individual variants, but browse only to the consolidated product pages.|A Configurable product offers the customers a variety of options, which are selected from drop-down lists. For example, a tee shirt that comes in three colors and three sizes would have two drop-down lists of options for Color and Size.|A Configurable product offers the customers a variety of options, which are selected from drop-down lists. For example, a tee shirt that comes in three colors and three sizes would have two drop-down lists of options for Color and Size.|A Configurable product offers the customers a variety of options, which are selected from drop-down lists. For example, a tee shirt that comes in three colors and three sizes would have two drop-down lists of options for Color and Size.|A Configurable product offers the customers a variety of options, which are selected from drop-down lists. For example, a tee shirt that comes in three colors and three sizes would have two drop-down lists of options for Color and Size.|A Configurable product offers the customers a variety of options, which are selected from drop-down lists. For example, a tee shirt that comes in three colors and three sizes would have two drop-down lists of options for Color and Size.|700|700|700|700|700|Black|Dark Blue|Violet|White|1'),
(26626, 52, 9, 'bag4|WorldCorp|White|Enabled|Taxable Goods|Marina Shopping Bag|One of the first things you are required to do when adding a new product to your catalog is to specify the product type. Magento’s product catalog is based upon six product types, which are divided into two groups which can be called “Simple” and “Complex.” In this case, the word “complex” conveys the meaning of compound, or one-to-many. A Simple product is a physical item with a single SKU. Simple products have a variety of pricing and input controls, which makes it possible to sell many variations of a product. Simple products can be used in association with Bundle, Grouped and Configurable Products. To create a Simple Product the first step is to choose the attribute set, which determines the fields that are included in the product record. The product can be based on the Default attribute set, which includes the standard set of fields used by most products.|There are many different product types in Magento. The Simple Product type should be used for that generally have a single configuration (one-size-fits-all). Every product can also have additional options.|99|1');
