(28217, 44, 2, 'ebook1|Enabled|Taxable Goods|Sample eBook|Magento offers the ability to sell downloads. You can create number of links for every Downloadable Product. Downloadable files can be located on your server or can be provided as URLs to any other server. Files can either be uploaded through the admin panel, or by uploading directly to the server via FTP and then added by URL. When a customer buys a Downloadable Product, product can be downloaded after logging in to the Customer Account. Magento will generate a secure, encrypted link for that customer to download the file (customer can''t see the file''s real location). A link can also be set to be shareable - it will be accessible without the requirement of logging in.|Magento offers the ability to sell downloads. This is great for software, digital music files, and other electronic products.|25|Magento Themes - The Ultimate User Guide|Magento Themes - Bonus Chapter|Click to download sample chapter|You can show your customers any number of samples|1'),
(26437, 36, 6, 'top2|Manufacturer|Blue|Enabled|Taxable Goods|Sample Product|Custom Variants and Options let you create product customization options and fields quickly and easily. Any product can have custom variants and options &ndash; this can be configured in its product configuration. Custom variants and options can be created for products as required or non-required options. They can affect the total price of the product by a fixed amount or percentage. In other words, custom variants and options allow you to make products that are unique and individualized. Whether it&rsquo;s a gift with a special message, a sweatshirt with custom embroidered text, or anything in between &ndash; possibilities are limitless.|Custom Variants and Options let you create product customization options and fields quickly and easily. Any product can have custom options.|45|1'),
