(26415, 1, 6, 'dress1|Enabled|Enabled|Enabled|Enabled|Enabled|Taxable Goods|Taxable Goods|Taxable Goods|Taxable Goods|Taxable Goods|SampleLogo|Sample Fashion Product|Sample Fashion Product (White S)|Sample Fashion Product (Black S)|Sample Fashion Product (White M)|Sample Fashion Product (Black M)|Configurable Products let your customers select the variant they desire by choosing options. For example, you sell t-shirts in two colors and three sizes. You&rsquo;d create the six variants as individual products (with their own skus) and then add these six to a configurable product from where customers can choose size and color, then add to cart. If desired you could also have customers search for &ldquo;red medium t-shirt&rdquo; and land on the specific page for this variant. Complex products in Magento are a way to consolidate product variants onto a single product info page in the front-end. The variants themselves are actually simple products and have their own SKUs and stock management. This is very powerful - it allows you to let customers search for the individual variants, but browse only to the consolidated product pages.|Configurable Products let your customers select the variant they desire by choosing options. For example, you sell t-shirts in two colors and three sizes. You’d create the six variants as individual products (with their own skus) and then add these six to a configurable product from where customers can choose size and color, then add to cart. If desired you could also have customers search for “red medium t-shirt” and land on the specific page for this variant. Complex products in Magento are a way to consolidate product variants onto a single product info page in the front-end. The variants themselves are actually simple products and have their own SKUs and stock management. This is very powerful - it allows you to let customers search for the individual variants, but browse only to the consolidated product pages.|Configurable Products let your customers select the variant they desire by choosing options. For example, you sell t-shirts in two colors and three sizes. You’d create the six variants as individual products (with their own skus) and then add these six to a configurable product from where customers can choose size and color, then add to cart. If desired you could also have customers search for “red medium t-shirt” and land on the specific page for this variant. Complex products in Magento are a way to consolidate product variants onto a single product info page in the front-end. The variants themselves are actually simple products and have their own SKUs and stock management. This is very powerful - it allows you to let customers search for the individual variants, but browse only to the consolidated product pages.|Configurable Products let your customers select the variant they desire by choosing options. For example, you sell t-shirts in two colors and three sizes. You’d create the six variants as individual products (with their own skus) and then add these six to a configurable product from where customers can choose size and color, then add to cart. If desired you could also have customers search for “red medium t-shirt” and land on the specific page for this variant. Complex products in Magento are a way to consolidate product variants onto a single product info page in the front-end. The variants themselves are actually simple products and have their own SKUs and stock management. This is very powerful - it allows you to let customers search for the individual variants, but browse only to the consolidated product pages.|Configurable Products let your customers select the variant they desire by choosing options. For example, you sell t-shirts in two colors and three sizes. You’d create the six variants as individual products (with their own skus) and then add these six to a configurable product from where customers can choose size and color, then add to cart. If desired you could also have customers search for “red medium t-shirt” and land on the specific page for this variant. Complex products in Magento are a way to consolidate product variants onto a single product info page in the front-end. The variants themselves are actually simple products and have their own SKUs and stock management. This is very powerful - it allows you to let customers search for the individual variants, but browse only to the consolidated product pages.|A Configurable product offers the customers a variety of options, which are selected from drop-down lists. For example, a tee shirt that comes in three colors and three sizes would have two drop-down lists of options for Color and Size.|A Configurable product offers the customers a variety of options, which are selected from drop-down lists. For example, a tee shirt that comes in three colors and three sizes would have two drop-down lists of options for Color and Size.|A Configurable product offers the customers a variety of options, which are selected from drop-down lists. For example, a tee shirt that comes in three colors and three sizes would have two drop-down lists of options for Color and Size.|A Configurable product offers the customers a variety of options, which are selected from drop-down lists. For example, a tee shirt that comes in three colors and three sizes would have two drop-down lists of options for Color and Size.|A Configurable product offers the customers a variety of options, which are selected from drop-down lists. For example, a tee shirt that comes in three colors and three sizes would have two drop-down lists of options for Color and Size.|50|50|50|50|50|White|Black|White|Black|1'),
(26593, 6, 9, 'dress2|Enabled|DummyBrand|Taxable Goods|White|Product With Custom Options|Custom Variants and Options let you create product customization options and fields quickly and easily. Any product can have custom variants and options &ndash; this can be configured in its product configuration. Custom variants and options can be created for products as required or non-required options. They can affect the total price of the product by a fixed amount or percentage. In other words, custom variants and options allow you to make products that are unique and individualized. Whether it&rsquo;s a gift with a special message, a sweatshirt with custom embroidered text, or anything in between &ndash; possibilities are limitless.|Custom Variants and Options let you create product customization options and fields quickly and easily. Any product can have custom options.|45|1'),
(28235, 44, 3, 'ebook1|Enabled|Taxable Goods|Sample eBook|Magento offers the ability to sell downloads. You can create number of links for every Downloadable Product. Downloadable files can be located on your server or can be provided as URLs to any other server. Files can either be uploaded through the admin panel, or by uploading directly to the server via FTP and then added by URL. When a customer buys a Downloadable Product, product can be downloaded after logging in to the Customer Account. Magento will generate a secure, encrypted link for that customer to download the file (customer can''t see the file''s real location). A link can also be set to be shareable - it will be accessible without the requirement of logging in.|Magento offers the ability to sell downloads. This is great for software, digital music files, and other electronic products.|25|Magento Themes - The Ultimate User Guide|Magento Themes - Bonus Chapter|Click to download sample chapter|You can show your customers any number of samples|1'),
(28236, 80, 3, 'blu01|Enabled|Blu|Taxable Goods|High|Black|Blu Classic Tobacco Pack|Nothing tops a classic. Classic Tobacco is the original blu e-cig flavor: a carefully crafted, proprietary blend of Burley and Brightleaf tobacco flavors. Then, the flavor of flue-cured Cavendish is added to the mix, bringing out the natural sweetness. For those who enjoy the taste and feel of a rich, full-flavored tobacco cigarette, Classic has you covered. It IS the electric cigarette flavor cartridge of choice.|Compatible with the blu Starter Pack, Premium and Original. Not for use with Premium100.|11.5|1'),
(28237, 81, 3, 'blu-menthol|Enabled|Blu|Taxable Goods|Natural|High|Magnificent Menthol Pack|Cool. Refreshing. Striking, yet subdued. Our Magnificent Menthol flavor cartridges deliver an aromatic, sub-zero surge of icy-cold tranquility. A delightful fusion of peppermint, spearmint and natural menthol crystals flavors are sure to please. Just one puff will keep you as chill as an arctic wind.|Compatible with the blu Starter Pack, Premium and Original. Not for use with Premium100.|11.5|1'),
(28238, 82, 3, 'blu-cherry|Blu|Black|Enabled|Taxable Goods|High|Cherry Crush Pack|A burst of Black Cherry swaddled in Maraschino undertones and blended with the dark mahogany blush of juicy Bing cherries, Cherry Crush is a tantalizingly tangy, potent, punchy and sweet addition to the line-up of blu e-cig flavors. Let Cherry Crush spark your senses with a dazzling trio of classic cherry flavors. Cherry Crush is the e-cigarette flavor that cherries aspire to be a part of.|Compatible with the blu Starter Pack, Premium and Original. Not for use with Premium100.|11.5|1'),
(28239, 84, 3, 'njoy-refills|Enabled|NJOY|Taxable Goods|Traditional|1.8%|NJOY Cartridge Refills|NJOY Cartridge Refills are now easier than ever to buy online. We offer free shipping and each pack of cartridge refills is equal to 1 carton of cigarettes. Buy NJOY, and get started today. The NJOY Traditional Electronic Cigarette Cartridge Refill package includes: 5 Traditional Flavor Electronic Cigarette Cartridges in each bottle Available in a variety of Nicotine Levels (1.8%, 1.2% and 0.6%) 1 NJOY Electronic Cigarette User Guide|NJOY Cartridge Refills are now easier than ever to buy online. We offer free shipping and each pack of cartridge refills is equal to 1 carton of cigarettes. Buy NJOY, and get started today.|19.99|1'),
