(28241, 86, 3, 'krave|Enabled|Krave|Taxable Goods|Traditional|High|KRAVE® KING - 5 Refill Filters for Rechargeable Electronic Cigarette|5 HIGH-CAPACITY REFILL FILTERS PER PACKAGE&nbsp; IN ORIGINAL TOBACCO &amp; MENTHOL FLAVORS&nbsp; ATOMIZED ALL-IN-ONE TECHNOLOGY FOR BEST EXPERIENCE&nbsp; EACH FILTER LASTS UP TO 160 PUFFS&nbsp; AVAILABLE IN 1.4% &amp; 1.8% NICOTINE STRENGTH&nbsp; TRADITIONAL WHITE FINISH WITH COLORED FLAVOR RING|5 HIGH-CAPACITY REFILL FILTERS PER PACKAGE|9.99|1'),
(28242, 87, 3, 'krave-menthol-bold|Enabled|Krave|Taxable Goods|FIN PACK OF 5 CARTOMIZERS MENTHOL - BOLD|The pack comes with 5 individual cartomizers&nbsp; Each cartomizer is the equivalent of nearly 2 packs of traditional cigarettes&nbsp; 2.4% Nicotine by volume INGREDIENTS: Propylene Glycol, Glycerin, Nicotine, Peppermint Oil, Vanillin, Menthyl Acetate, Carvone Laevo, Menthone Racemic, Menthol Crystals Natural, Ethyl Menthane Carboxamide.|The pack comes with 5 individual cartomizers of 2.4% Nicotine, Bold Menthol flavor.|14.99|1'),
(28243, 88, 3, 'LOGIC Cartomizers (Platinum, Black, & Gold Labels)|Enabled|Logic|Taxable Goods|2.4%|Tobacco|LOGIC Cartomizers (Platinum, Black, & Gold Labels)|LOGIC cartomizers deliver the same taste as our disposable line. Each cartomizer contains 400 puffs (equals to 2 packs of cigarettes) therefore since 5 come in 1 pack, each pack is equivalent to 1 carton of cigarettes. Platinum cartomizers come in your choice of Tobacco or Menthol.|LOGIC Cartomizers In Your Choice Of Platinum, Black, Or Gold Labels|21.99|1'),
