(28208, 89, 1, 'FlavorMax Cartomizers|Enabled|GreenSmoke|Taxable Goods|Absolute Tobacco|Strong (2.4%)|Green Smoke FlavorMax Cartomizers|FlavorMax&trade; Cartomizers are among the longest lasting cartomizers available and give you 25% more vapor than other leading brands. You can pull up to 360 puffs from each cartomizer which is comparable to up to 1.5 packs of traditional cigarettes. FlavorMax&trade; Cartomizers are also triple sealed ensuring that you get the freshest, fullest flavor with every puff.|FlavorMax&trade; Cartomizers &ndash; longer, fresher, better. The next level in smoking.|16.49|1'),
(26533, 1, 8, 'dress1|Enabled|Enabled|Enabled|Enabled|Enabled|Taxable Goods|Taxable Goods|Taxable Goods|Taxable Goods|Taxable Goods|SampleLogo|Sample Fashion Product|Sample Fashion Product (White S)|Sample Fashion Product (Black S)|Sample Fashion Product (White M)|Sample Fashion Product (Black M)|Configurable Products let your customers select the variant they desire by choosing options. For example, you sell t-shirts in two colors and three sizes. You&rsquo;d create the six variants as individual products (with their own skus) and then add these six to a configurable product from where customers can choose size and color, then add to cart. If desired you could also have customers search for &ldquo;red medium t-shirt&rdquo; and land on the specific page for this variant. Complex products in Magento are a way to consolidate product variants onto a single product info page in the front-end. The variants themselves are actually simple products and have their own SKUs and stock management. This is very powerful - it allows you to let customers search for the individual variants, but browse only to the consolidated product pages.|Configurable Products let your customers select the variant they desire by choosing options. For example, you sell t-shirts in two colors and three sizes. You’d create the six variants as individual products (with their own skus) and then add these six to a configurable product from where customers can choose size and color, then add to cart. If desired you could also have customers search for “red medium t-shirt” and land on the specific page for this variant. Complex products in Magento are a way to consolidate product variants onto a single product info page in the front-end. The variants themselves are actually simple products and have their own SKUs and stock management. This is very powerful - it allows you to let customers search for the individual variants, but browse only to the consolidated product pages.|Configurable Products let your customers select the variant they desire by choosing options. For example, you sell t-shirts in two colors and three sizes. You’d create the six variants as individual products (with their own skus) and then add these six to a configurable product from where customers can choose size and color, then add to cart. If desired you could also have customers search for “red medium t-shirt” and land on the specific page for this variant. Complex products in Magento are a way to consolidate product variants onto a single product info page in the front-end. The variants themselves are actually simple products and have their own SKUs and stock management. This is very powerful - it allows you to let customers search for the individual variants, but browse only to the consolidated product pages.|Configurable Products let your customers select the variant they desire by choosing options. For example, you sell t-shirts in two colors and three sizes. You’d create the six variants as individual products (with their own skus) and then add these six to a configurable product from where customers can choose size and color, then add to cart. If desired you could also have customers search for “red medium t-shirt” and land on the specific page for this variant. Complex products in Magento are a way to consolidate product variants onto a single product info page in the front-end. The variants themselves are actually simple products and have their own SKUs and stock management. This is very powerful - it allows you to let customers search for the individual variants, but browse only to the consolidated product pages.|Configurable Products let your customers select the variant they desire by choosing options. For example, you sell t-shirts in two colors and three sizes. You’d create the six variants as individual products (with their own skus) and then add these six to a configurable product from where customers can choose size and color, then add to cart. If desired you could also have customers search for “red medium t-shirt” and land on the specific page for this variant. Complex products in Magento are a way to consolidate product variants onto a single product info page in the front-end. The variants themselves are actually simple products and have their own SKUs and stock management. This is very powerful - it allows you to let customers search for the individual variants, but browse only to the consolidated product pages.|A Configurable product offers the customers a variety of options, which are selected from drop-down lists. For example, a tee shirt that comes in three colors and three sizes would have two drop-down lists of options for Color and Size.|A Configurable product offers the customers a variety of options, which are selected from drop-down lists. For example, a tee shirt that comes in three colors and three sizes would have two drop-down lists of options for Color and Size.|A Configurable product offers the customers a variety of options, which are selected from drop-down lists. For example, a tee shirt that comes in three colors and three sizes would have two drop-down lists of options for Color and Size.|A Configurable product offers the customers a variety of options, which are selected from drop-down lists. For example, a tee shirt that comes in three colors and three sizes would have two drop-down lists of options for Color and Size.|A Configurable product offers the customers a variety of options, which are selected from drop-down lists. For example, a tee shirt that comes in three colors and three sizes would have two drop-down lists of options for Color and Size.|50|50|50|50|50|White|Black|White|Black|1'),
(26473, 76, 6, 'headphones8|Enabled|Soundwave|Taxable Goods|Orange|Radio Micro Headset|The product edit panel in Magento provides access to the full range of settings which make up a product record. The information in this section can be used for reference when creating a product of any type. The selection of tabs in the Product Information panel, and the organization of the fields on each tab is determined by the attribute set that was used to create the product. One of the first things you are required to do when adding a new product to your catalog is to specify the product type. Here are some selected options of Catalog Management offered by Magento: Inventory Management with Backordered items, Minimum and Maximum quantities Simple, Configurable (e.g. size, color, etc.), Bundled and Grouped Products Downloadable/Digital Products, Virtual Products Customer Personalized Products - upload text for embroidery, monogramming, etc. Create Store-specific attributes on the fly Tax Rates per location, customer group and product type Advanced Pricing Rules and support for Special Prices (see marketing tools) Attribute Sets for quick product creation of different item types Media Manager with automatic image resizing and watermarking Search Results rewrites and redirects Approve, Edit and Delete Product Reviews and Tags RSS feed for Low Inventory Alerts Batch Import and Export of catalog Batch Updates to products in admin panel|There are many different product types in Magento. The Simple Product type should be used for that generally have a single configuration. Every product can also have additional options.|65.99|1'),
