(28199, 44, 1, 'ebook1|Enabled|Taxable Goods|Sample eBook|Magento offers the ability to sell downloads. You can create number of links for every Downloadable Product. Downloadable files can be located on your server or can be provided as URLs to any other server. Files can either be uploaded through the admin panel, or by uploading directly to the server via FTP and then added by URL. When a customer buys a Downloadable Product, product can be downloaded after logging in to the Customer Account. Magento will generate a secure, encrypted link for that customer to download the file (customer can''t see the file''s real location). A link can also be set to be shareable - it will be accessible without the requirement of logging in.|Magento offers the ability to sell downloads. This is great for software, digital music files, and other electronic products.|25|Magento Themes - The Ultimate User Guide|Magento Themes - Bonus Chapter|Click to download sample chapter|You can show your customers any number of samples|1'),
(28200, 80, 1, 'blu01|Enabled|Blu|Taxable Goods|High|Black|Blu Classic Tobacco Pack|Nothing tops a classic. Classic Tobacco is the original blu e-cig flavor: a carefully crafted, proprietary blend of Burley and Brightleaf tobacco flavors. Then, the flavor of flue-cured Cavendish is added to the mix, bringing out the natural sweetness. For those who enjoy the taste and feel of a rich, full-flavored tobacco cigarette, Classic has you covered. It IS the electric cigarette flavor cartridge of choice.|Compatible with the blu Starter Pack, Premium and Original. Not for use with Premium100.|11.5|1'),
(28201, 81, 1, 'blu-menthol|Enabled|Blu|Taxable Goods|Natural|High|Magnificent Menthol Pack|Cool. Refreshing. Striking, yet subdued. Our Magnificent Menthol flavor cartridges deliver an aromatic, sub-zero surge of icy-cold tranquility. A delightful fusion of peppermint, spearmint and natural menthol crystals flavors are sure to please. Just one puff will keep you as chill as an arctic wind.|Compatible with the blu Starter Pack, Premium and Original. Not for use with Premium100.|11.5|1'),
(28202, 82, 1, 'blu-cherry|Blu|Black|Enabled|Taxable Goods|High|Cherry Crush Pack|A burst of Black Cherry swaddled in Maraschino undertones and blended with the dark mahogany blush of juicy Bing cherries, Cherry Crush is a tantalizingly tangy, potent, punchy and sweet addition to the line-up of blu e-cig flavors. Let Cherry Crush spark your senses with a dazzling trio of classic cherry flavors. Cherry Crush is the e-cigarette flavor that cherries aspire to be a part of.|Compatible with the blu Starter Pack, Premium and Original. Not for use with Premium100.|11.5|1'),
(28203, 84, 1, 'njoy-refills|Enabled|NJOY|Taxable Goods|Traditional|1.8%|NJOY Cartridge Refills|NJOY Cartridge Refills are now easier than ever to buy online. We offer free shipping and each pack of cartridge refills is equal to 1 carton of cigarettes. Buy NJOY, and get started today. The NJOY Traditional Electronic Cigarette Cartridge Refill package includes: 5 Traditional Flavor Electronic Cigarette Cartridges in each bottle Available in a variety of Nicotine Levels (1.8%, 1.2% and 0.6%) 1 NJOY Electronic Cigarette User Guide|NJOY Cartridge Refills are now easier than ever to buy online. We offer free shipping and each pack of cartridge refills is equal to 1 carton of cigarettes. Buy NJOY, and get started today.|19.99|1'),
