(28205, 86, 1, 'krave|Enabled|Krave|Taxable Goods|Traditional|High|KRAVE® KING - 5 Refill Filters for Rechargeable Electronic Cigarette|5 HIGH-CAPACITY REFILL FILTERS PER PACKAGE&nbsp; IN ORIGINAL TOBACCO &amp; MENTHOL FLAVORS&nbsp; ATOMIZED ALL-IN-ONE TECHNOLOGY FOR BEST EXPERIENCE&nbsp; EACH FILTER LASTS UP TO 160 PUFFS&nbsp; AVAILABLE IN 1.4% &amp; 1.8% NICOTINE STRENGTH&nbsp; TRADITIONAL WHITE FINISH WITH COLORED FLAVOR RING|5 HIGH-CAPACITY REFILL FILTERS PER PACKAGE|9.99|1'),
