(28271, 44, 5, 'ebook1|Enabled|Taxable Goods|Sample eBook|Magento offers the ability to sell downloads. You can create number of links for every Downloadable Product. Downloadable files can be located on your server or can be provided as URLs to any other server. Files can either be uploaded through the admin panel, or by uploading directly to the server via FTP and then added by URL. When a customer buys a Downloadable Product, product can be downloaded after logging in to the Customer Account. Magento will generate a secure, encrypted link for that customer to download the file (customer can''t see the file''s real location). A link can also be set to be shareable - it will be accessible without the requirement of logging in.|Magento offers the ability to sell downloads. This is great for software, digital music files, and other electronic products.|25|Magento Themes - The Ultimate User Guide|Magento Themes - Bonus Chapter|Click to download sample chapter|You can show your customers any number of samples|1'),
(26417, 7, 6, 'dress3|Enabled|SampleLogo|Taxable Goods|Gray|Sample Customizable Dress|Configurable Products let your customers select the variant they desire by choosing options. For example, you sell t-shirts in two colors and three sizes. You’d create the six variants as individual products (with their own skus) and then add these six to a configurable product from where customers can choose size and color, then add to cart. If desired you could also have customers search for “red medium t-shirt” and land on the specific page for this variant. Complex products in Magento are a way to consolidate product variants onto a single product info page in the front-end. The variants themselves are actually simple products and have their own SKUs and stock management. This is very powerful - it allows you to let customers search for the individual variants, but browse only to the consolidated product pages.|A Configurable product offers the customers a variety of options, which are selected from drop-down lists. For example, a tee shirt that comes in three colors and three sizes would have two drop-down lists of options for Color and Size.|79.99|1'),
(26416, 6, 6, 'dress2|Enabled|DummyBrand|Taxable Goods|White|Product With Custom Options|Custom Variants and Options let you create product customization options and fields quickly and easily. Any product can have custom variants and options &ndash; this can be configured in its product configuration. Custom variants and options can be created for products as required or non-required options. They can affect the total price of the product by a fixed amount or percentage. In other words, custom variants and options allow you to make products that are unique and individualized. Whether it&rsquo;s a gift with a special message, a sweatshirt with custom embroidered text, or anything in between &ndash; possibilities are limitless.|Custom Variants and Options let you create product customization options and fields quickly and easily. Any product can have custom options.|45|1'),
(26475, 6, 7, 'dress2|Enabled|DummyBrand|Taxable Goods|White|Product With Custom Options|Custom Variants and Options let you create product customization options and fields quickly and easily. Any product can have custom variants and options &ndash; this can be configured in its product configuration. Custom variants and options can be created for products as required or non-required options. They can affect the total price of the product by a fixed amount or percentage. In other words, custom variants and options allow you to make products that are unique and individualized. Whether it&rsquo;s a gift with a special message, a sweatshirt with custom embroidered text, or anything in between &ndash; possibilities are limitless.|Custom Variants and Options let you create product customization options and fields quickly and easily. Any product can have custom options.|45|1'),
