(26531, 75, 7, 'headphones7|Enabled|Soundwave|Taxable Goods|White|Soundwave Earphones|The product edit panel in Magento provides access to the full range of settings which make up a product record. The information in this section can be used for reference when creating a product of any type. The selection of tabs in the Product Information panel, and the organization of the fields on each tab is determined by the attribute set that was used to create the product. One of the first things you are required to do when adding a new product to your catalog is to specify the product type. Here are some selected options of Catalog Management offered by Magento: Inventory Management with Backordered items, Minimum and Maximum quantities Simple, Configurable (e.g. size, color, etc.), Bundled and Grouped Products Downloadable/Digital Products, Virtual Products Customer Personalized Products - upload text for embroidery, monogramming, etc. Create Store-specific attributes on the fly Tax Rates per location, customer group and product type Advanced Pricing Rules and support for Special Prices (see marketing tools) Attribute Sets for quick product creation of different item types Media Manager with automatic image resizing and watermarking Search Results rewrites and redirects Approve, Edit and Delete Product Reviews and Tags RSS feed for Low Inventory Alerts Batch Import and Export of catalog Batch Updates to products in admin panel|There are many different product types in Magento. The Simple Product type should be used for that generally have a single configuration. Every product can also have additional options.|54.99|1'),
