INSERT INTO `catalog_product_entity_text` (`value_id`, `entity_type_id`, `attribute_id`, `store_id`, `entity_id`, `value`) VALUES
(156, 4, 72, 0, 21, '<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Curabitur pharetra faucibus congue. Aenean luctus dolor et purus malesuada luctus. Quisque ullamcorper ante viverra lectus fermentum quis rutrum erat sollicitudin. Fusce tortor massa.</p>\r\n<p>Faucibus ut blandit cursus, varius vel mauris. Maecenas nec ullamcorper enim. Vestibulum neque leo, vehicula in consectetur sit amet, fringilla eu purus. Pellentesque egestas, felis in hendrerit porta, mauris sem pharetra ligula, sit amet ultrices enim mi ac turpis. Ut sed nisi a magna blandit imperdiet ut eu urna. Integer id enim justo. Cras nulla mauris, rhoncus at commodo ac, pretium feugiat dui. Cras ullamcorper nisl non odio congue accumsan. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Aliquam erat volutpat.</p>'),
(157, 4, 73, 0, 21, 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Curabitur pharetra faucibus congue. Aenean luctus dolor et purus malesuada luctus. Quisque ullamcorper ante viverra lectus fermentum quis rutrum erat sollicitudin. Fusce tortor massa.'),
(158, 4, 83, 0, 21, NULL),
(159, 4, 106, 0, 21, NULL),
(162, 4, 72, 0, 22, '<p>Custom Variants and Options let you create product customization options and fields quickly and easily. Any product can have custom variants and options &ndash; this can be configured in its product configuration. Custom variants and options can be created for products as required or non-required options. They can affect the total price of the product by a fixed amount or percentage.</p>\r\n<p>In other words, custom variants and options allow you to make products that are unique and individualized. Whether it&rsquo;s a gift with a special message, a sweatshirt with custom embroidered text, or anything in between &ndash; possibilities are limitless.</p>'),
(163, 4, 73, 0, 22, 'Custom Variants and Options let you create product customization options and fields quickly and easily. Any product can have custom options.'),
(164, 4, 83, 0, 22, NULL),
(165, 4, 106, 0, 22, NULL),
(195, 4, 72, 0, 24, '<p>Configurable Products let your customers select the variant they desire by choosing options. For example, you sell t-shirts in two colors and three sizes. You&rsquo;d create the six variants as individual products (with their own skus) and then add these six to a configurable product from where customers can choose size and color, then add to cart. If desired you could also have customers search for &ldquo;red medium t-shirt&rdquo; and land on the specific page for this variant.</p>\r\n<p>Complex products in Magento are a way to consolidate product variants onto a single product info page in the front-end. The variants themselves are actually simple products and have their own SKUs and stock management. This is very powerful - it allows you to let customers search for the individual variants, but browse only to the consolidated product pages.</p>'),
(196, 4, 73, 0, 24, 'A Configurable product offers the customers a variety of options, which are selected from drop-down lists. For example, a tee shirt that comes in three colors and three sizes would have two drop-down lists of options for Color and Size.'),
(197, 4, 83, 0, 24, NULL),
(198, 4, 106, 0, 24, NULL),
(201, 4, 72, 0, 25, '<p>Configurable Products let your customers select the variant they desire by choosing options. For example, you sell t-shirts in two colors and three sizes. You&rsquo;d create the six variants as individual products (with their own skus) and then add these six to a configurable product from where customers can choose size and color, then add to cart. If desired you could also have customers search for &ldquo;red medium t-shirt&rdquo; and land on the specific page for this variant.</p>\r\n<p>Complex products in Magento are a way to consolidate product variants onto a single product info page in the front-end. The variants themselves are actually simple products and have their own SKUs and stock management. This is very powerful - it allows you to let customers search for the individual variants, but browse only to the consolidated product pages.</p>'),
(202, 4, 73, 0, 25, 'A Configurable product offers the customers a variety of options, which are selected from drop-down lists. For example, a tee shirt that comes in three colors and three sizes would have two drop-down lists of options for Color and Size.'),
