(281, 4, 72, 0, 34, '<p>A Grouped Product lets you offer multiple, standalone products for sale as a group on the same Product Detail page. You can offer variations of a single product, or group them by season or theme to create a coordinated set. Products can be purchased separately, or as part of the group. Each product purchased appears in the Shopping Cart as a separate item.</p>\r\n<p>The Product Detail page of a Grouped Product displays the image and description from the Grouped Product record, and lists the name of each associated product with the price, and input box for the quantity ordered.</p>\r\n<ul><li>Phasellus nulla massa, malesuada sed pulvinar</li><li>Lorem ipsum dolor sit amet</li><li>Maecenas doneton nec mauris magna</li></ul>'),
(282, 4, 73, 0, 34, 'A Grouped Product lets you offer multiple, standalone products for sale as a group on the same Product Detail page.'),
