(433, 4, 72, 0, 44, '<p>Magento offers the ability to sell downloads. You can create number of links for every Downloadable Product. Downloadable files can be located on your server or can be provided as URLs to any other server. Files can either be uploaded through the admin panel, or by uploading directly to the server via FTP and then added by URL.</p>\r\n\r\n<p>When a customer buys a Downloadable Product, product can be downloaded after logging in to the Customer Account. Magento will generate a secure, encrypted link for that customer to download the file (customer can''t see the file''s real location). A link can also be set to be shareable - it will be accessible without the requirement of logging in.</p>'),
(434, 4, 73, 0, 44, 'Magento offers the ability to sell downloads. This is great for software, digital music files, and other electronic products.'),
