(808, 4, 72, 0, 80, 'Nothing tops a classic. Classic Tobacco is the original blu e-cig flavor: a carefully crafted, proprietary blend of Burley and Brightleaf tobacco flavors. Then, the flavor of flue-cured Cavendish is added to the mix, bringing out the natural sweetness. For those who enjoy the taste and feel of a rich, full-flavored tobacco cigarette, Classic has you covered. It IS the electric cigarette flavor cartridge of choice.'),
(809, 4, 73, 0, 80, 'Compatible with the blu Starter Pack, Premium and Original. Not for use with Premium100.'),
(810, 4, 83, 0, 80, NULL),
(811, 4, 106, 0, 80, NULL),
(872, 4, 72, 0, 81, 'Cool. Refreshing. Striking, yet subdued. Our Magnificent Menthol flavor cartridges deliver an aromatic, sub-zero surge of icy-cold tranquility. A delightful fusion of peppermint, spearmint and natural menthol crystals flavors are sure to please. Just one puff will keep you as chill as an arctic wind.'),
(873, 4, 73, 0, 81, '<p><strong>Compatible with the blu Starter Pack, Premium and Original. Not for use with Premium100.</strong></p>'),
(874, 4, 83, 0, 81, NULL),
(875, 4, 106, 0, 81, NULL),
(898, 4, 72, 0, 82, 'A burst of Black Cherry swaddled in Maraschino undertones and blended with the dark mahogany blush of juicy Bing cherries, Cherry Crush is a tantalizingly tangy, potent, punchy and sweet addition to the line-up of blu e-cig flavors. Let Cherry Crush spark your senses with a dazzling trio of classic cherry flavors. Cherry Crush is the e-cigarette flavor that cherries aspire to be a part of.'),
(899, 4, 73, 0, 82, '<p><strong>Compatible with the blu Starter Pack, Premium and Original. Not for use with Premium100.</strong></p>'),
(900, 4, 83, 0, 82, NULL),
(901, 4, 106, 0, 82, NULL),
(918, 4, 72, 0, 84, 'NJOY Cartridge Refills are now easier than ever to buy online. We offer free shipping and each pack of cartridge refills is equal to 1 carton of cigarettes. Buy NJOY, and get started today.\r\n\r\nThe NJOY Traditional Electronic Cigarette Cartridge Refill package includes: \r\n\r\n5 Traditional Flavor Electronic Cigarette Cartridges in each bottle\r\nAvailable in a variety of Nicotine Levels (1.8%, 1.2% and 0.6%)\r\n1 NJOY Electronic Cigarette User Guide'),
(919, 4, 73, 0, 84, 'NJOY Cartridge Refills are now easier than ever to buy online. We offer free shipping and each pack of cartridge refills is equal to 1 carton of cigarettes. Buy NJOY, and get started today.'),
(920, 4, 83, 0, 84, NULL),
(921, 4, 106, 0, 84, NULL),
(932, 4, 72, 0, 85, '0% Menthol Cartridges - 3 pack Bundle\r\n\r\n15 Total Cartridges\r\n\r\nMenthol Flavor\r\n\r\n0% Nicotine by Volume'),
(933, 4, 73, 0, 85, '0% Menthol Cartridges - 3 pack Bundle'),
(934, 4, 83, 0, 85, NULL),
(935, 4, 106, 0, 85, NULL),
(958, 4, 72, 0, 86, '<ul>\r\n<li>5 HIGH-CAPACITY REFILL FILTERS PER PACKAGE&nbsp;</li>\r\n<li>IN ORIGINAL TOBACCO &amp; MENTHOL FLAVORS&nbsp;</li>\r\n<li>ATOMIZED ALL-IN-ONE TECHNOLOGY FOR BEST EXPERIENCE&nbsp;</li>\r\n<li>EACH FILTER LASTS UP TO 160 PUFFS&nbsp;</li>\r\n<li>AVAILABLE IN 1.4% &amp; 1.8% NICOTINE STRENGTH&nbsp;</li>\r\n<li>TRADITIONAL WHITE FINISH WITH COLORED FLAVOR RING</li>\r\n</ul>'),
(959, 4, 73, 0, 86, '5 HIGH-CAPACITY REFILL FILTERS PER PACKAGE'),
(960, 4, 83, 0, 86, NULL),
(961, 4, 106, 0, 86, NULL),
(970, 4, 72, 0, 87, '<ul>\r\n<li>The pack comes with 5 individual cartomizers&nbsp;</li>\r\n<li>Each cartomizer is the equivalent of nearly 2 packs of traditional cigarettes&nbsp;</li>\r\n<li>2.4% Nicotine by volume</li>\r\n</ul>\r\n<p>INGREDIENTS: Propylene Glycol, Glycerin, Nicotine, Peppermint Oil, Vanillin, Menthyl Acetate, Carvone Laevo, Menthone Racemic, Menthol Crystals Natural, Ethyl Menthane Carboxamide.</p>'),
(971, 4, 73, 0, 87, '<p>The pack comes with 5 individual cartomizers of 2.4% Nicotine, Bold Menthol flavor.</p>'),
(972, 4, 83, 0, 87, NULL),
(973, 4, 106, 0, 87, NULL),
(986, 4, 72, 0, 88, '<p>LOGIC cartomizers deliver the same taste as our disposable line. Each cartomizer contains 400 puffs (equals to 2 packs of cigarettes) therefore since 5 come in 1 pack, each pack is equivalent to 1 carton of cigarettes. Platinum cartomizers come in your choice of Tobacco or Menthol.</p>'),
(987, 4, 73, 0, 88, '<p>LOGIC Cartomizers In Your Choice Of Platinum, Black, Or Gold Labels</p>'),
(988, 4, 83, 0, 88, NULL),
(989, 4, 106, 0, 88, NULL),
(998, 4, 72, 0, 89, '<p>FlavorMax&trade; Cartomizers are among the longest lasting cartomizers available and give you 25% more vapor than other leading brands. You can pull up to 360 puffs from each cartomizer which is comparable to up to 1.5 packs of traditional cigarettes. FlavorMax&trade; Cartomizers are also triple sealed ensuring that you get the freshest, fullest flavor with every puff.</p>'),
(999, 4, 73, 0, 89, '<p><strong>FlavorMax&trade; Cartomizers &ndash; longer, fresher, better. The next level in smoking.</strong></p>'),
(1000, 4, 83, 0, 89, NULL),
(1001, 4, 106, 0, 89, NULL);
