INSERT INTO `cms_block` (`block_id`, `title`, `identifier`, `content`, `creation_time`, `update_time`, `is_active`) VALUES
(2, 'Custom landing page 1', 'block_landing_page1', '<div class="landing-page nested-container">\r\n	<br />\r\n    \r\n	<div class="vertical-section grid12-4 persistent-grid2-1">\r\n        <a href="{{store direct_url="downloadable/ebooks.html"}}">\r\n        	<img class="center-block" src="{{media url="wysiwyg/infortis/ultimo/custom/landing/vert1.jpg"}}" alt="Sample banner" />\r\n            <div class="caption dark2 full-width">\r\n                <h2 class="heading permanent">Lorem</h2>\r\n                <p class="permanent">Nullam ornare enim nectis</p>\r\n                <p>Lorem ipsum dolor </p>\r\n            </div>\r\n        </a>\r\n	</div>\r\n	<div class="vertical-section grid12-4 persistent-grid2-1">\r\n        <a href="{{store direct_url="downloadable/music.html"}}">\r\n        	<img class="center-block" src="{{media url="wysiwyg/infortis/ultimo/custom/landing/vert2.jpg"}}" alt="Sample banner" />\r\n            <div class="caption dark2 full-width">\r\n	            <h2 class="heading permanent">Ipsum</h2>\r\n    	        <p class="permanent">In eget metus ornare itis est</p>\r\n        	    <p>Lorem ipsum dolor </p>\r\n            </div>\r\n        </a>\r\n	</div>\r\n	<div class="vertical-section grid12-4 persistent-grid2-1">\r\n        <a href="{{store direct_url="downloadable/software.html"}}">\r\n        	<img class="center-block" src="{{media url="wysiwyg/infortis/ultimo/custom/landing/vert3.jpg"}}" alt="Sample banner" />\r\n            <div class="caption dark2 full-width">\r\n	            <h2 class="heading permanent">Dolor</h2>\r\n    	        <p class="permanent">Etiam neque velit blandit sed</p>\r\n        	    <p>Lorem ipsum dolor </p>\r\n            </div>\r\n        </a>\r\n	</div>\r\n    <br />\r\n    \r\n	<div class="vertical-section grid-full">\r\n		{{block type="ultimo/product_list_featured" category_id="58" product_count="16" show_items="5" is_responsive="1" centered="1" size="size-s" move="2" hide_button="1" block_name="See Also: Recommended New Products" template="catalog/product/list_featured_slider.phtml"}}\r\n	</div>\r\n</div>', '2012-10-04 20:41:08', '2013-11-01 01:37:50', 1),
(3, 'Custom footer links 2', 'block_footer_links2', '<ul class="links hide-below-768">\r\n\r\n	<li class="first">\r\n		<a href="{{store direct_url=''about-magento-demo-store/''}}" title="You can add more custom links here">About Us</a>\r\n	</li>\r\n	<li class="last">\r\n		<a href="{{store direct_url=''customer-service/''}}"  title="You can even replace these links with any other content">Customer Service</a>\r\n	</li>\r\n\r\n</ul>', '2012-10-04 20:41:08', '2013-07-02 19:28:46', 1),
(4, 'Custom footer links', 'block_footer_links', 'This block can replace Magento''s default footer links.\r\n\r\n<ul class="links">\r\n\r\n    <li class="first">\r\n    	<a href="{{store url=''''}}" title="">Custom Link</a>\r\n    </li>\r\n    <li>\r\n    	<a href="{{store url=''catalog/seo_sitemap/category''}}" title="The Site Map">Site Map</a>\r\n    </li>\r\n    <li>\r\n    	<a href="{{store url=''catalogsearch/term/popular''}}" title="Search Terms">Search Terms</a>\r\n    </li>\r\n    <li>\r\n    	<a href="{{store url=''catalogsearch/advanced''}}" title="Advanced Search">Advanced Search</a>\r\n    </li>\r\n    <li>\r\n    	<a href="{{store url=''sales/guest/form''}}" title="Orders and Returns">Orders and Returns</a>\r\n    </li>\r\n    <li>\r\n    	<a href="{{store url=''contacts''}}" title="Contact Us">Contact Us</a>\r\n    </li>\r\n    <li class=" last">\r\n    	<a class="link-rss" href="{{store url=''rss''}}" title="RSS">RSS</a>\r\n    </li>\r\n    \r\n</ul>', '2012-10-04 20:41:09', '2013-07-02 19:46:46', 0),
(5, 'Category above collection', 'block_category_above_collection', '<div class="sample-block">Static CMS block displayed above list/grid of products. Put your own content here.</div>', '2012-10-04 20:41:09', '2012-10-22 16:40:05', 0),
(6, 'Footer primary bottom left - social links', 'block_footer_primary_bottom_left', '<div class="social-links icon-wrapper-square">\r\n\r\n	<a class="first" href="http://twitter.com/infortis" title="Follow Infortis on Twitter">\r\n		<span class="icon icon-hover i-twitter-w"></span>\r\n	</a>\r\n	<a href="#" title="Join us on Facebook">\r\n		<span class="icon icon-hover i-facebook-w"></span>\r\n	</a>\r\n	<a href="#" title="Join us on Google Plus">\r\n		<span class="icon icon-hover i-googleplus-w"></span>\r\n	</a>\r\n	<a href="#" title="Wordpress">\r\n		<span class="icon icon-hover i-wordpress-w"></span>\r\n	</a>\r\n	<a href="#" title="Pinterest">\r\n		<span class="icon icon-hover i-pinterest-w"></span>\r\n	</a>\r\n	<a href="#" title="Linked in">\r\n		<span class="icon icon-hover i-linkedin-w"></span>\r\n	</a>\r\n\r\n</div>', '2012-10-04 20:41:10', '2014-02-08 23:57:10', 1),
(7, 'Footer payment', 'block_footer_payment', '<img src="{{media url="wysiwyg/infortis/ultimo/custom/payment.gif}}" alt="Payment methods" title="Sample image with payment methods" />', '2012-10-04 20:41:10', '2012-10-04 20:41:10', 1),
(8, 'Category below collection', 'block_category_below_collection', '<div class="nested-container hide-below-768">\r\n\r\n    <div class="page-banners clearer">\r\n        <div class="grid12-6 banner">\r\n            <a href="{{store direct_url="about-magento-demo-store"}}" title="Replace this image with your own">\r\n                <img src="{{media url="wysiwyg/infortis/ultimo/custom/banners/01.png"}}" alt="Sample banner" />\r\n            </a>\r\n        </div>\r\n        <div class="grid12-6 banner">\r\n            <a href="{{store direct_url="about-magento-demo-store"}}" title="Replace this image with your own">\r\n                <img src="{{media url="wysiwyg/infortis/ultimo/custom/banners/03.png"}}" alt="Sample banner" />\r\n            </a>\r\n        </div>\r\n    </div>\r\n\r\n</div>', '2012-10-04 20:41:11', '2013-11-01 01:33:52', 0),
(9, 'Category above empty collection', 'block_category_above_empty_collection', '<div class="note-msg empty-catalog">\r\n\r\n	<h3>There are no products matching the selection</h3>\r\n	This is a custom CMS block displayed if category is empty.<br>\r\n	You can replace it with any custom content.\r\n\r\n</div>', '2012-10-04 20:41:11', '2013-04-07 12:06:44', 1),
(10, 'Product secondary column bottom', 'block_product_secondary_bottom', '<div class="feature feature-icon-hover indent first"><span class="icon"> <img src="{{media url="wysiwyg/infortis/ultimo/icons/delivery.png"}}" alt="" /> </span>\r\n<p class="no-margin ">We will send this product in 2 days. <a href="#">Read more...</a></p>\r\n</div>\r\n<div class="feature feature-icon-hover indent"><span class="icon"> <img src="{{media url="wysiwyg/infortis/ultimo/icons/phone.png"}}" alt="" /> </span>\r\n<p class="no-margin ">Call us now for more info about our products.</p>\r\n</div>\r\n<div class="feature feature-icon-hover indent last"><span class="icon"> <img src="{{media url="wysiwyg/infortis/ultimo/icons/back.png"}}" alt="" /> </span>\r\n<p class="no-margin ">Return purchased items and get all your money back.</p>\r\n</div>\r\n\r\n<!-- Social bookmarks from http://www.addthis.com/get/sharing  -->\r\n<p>&nbsp;</p>\r\n<!--\r\n<div class="feature-wrapper top-border">\r\n	<div class="addthis_toolbox addthis_default_style ">\r\n	<a class="addthis_button_preferred_1"></a>\r\n	<a class="addthis_button_preferred_2"></a>\r\n	<a class="addthis_button_preferred_3"></a>\r\n	<a class="addthis_button_preferred_4"></a>\r\n	<a class="addthis_button_compact"></a>\r\n	<a class="addthis_counter addthis_bubble_style"></a>\r\n	</div>\r\n	<script type="text/javascript" src="http://s7.addthis.com/js/300/addthis_widget.js#pubid=xa-5054e6c6502d114f"></script>\r\n</div>\r\n-->', '2012-10-04 20:41:12', '2014-02-04 02:26:04', 1),
(11, 'Product - primary column bottom', 'block_product_primary_bottom', 'Sample content of the static block - primary column bottom.', '2012-10-04 20:41:12', '2013-09-03 02:15:07', 0),
(12, 'Cart - below totals', 'block_cart_below_totals', '<div class="hide-below-320" style="display: table; float: right; padding-right: 10px; text-align: right;"><span style="display: table-cell; vertical-align: middle;">Sample info about SSL Certificate</span> <img src="{{media url="wysiwyg/infortis/ultimo/custom/block_cart_below_totals.png"}}" alt="Example Image" title="Static CMS block displayed below totals. Put your own content here." /></div>', '2012-10-04 20:41:13', '2012-10-23 01:24:59', 1),
(13, 'One page checkout  below progress', 'block_opc_below_progress', '<div class="sample-block">Custom CMS block displayed below the one page checkout progress block. Put your own content here.</div>', '2012-10-04 20:41:14', '2013-01-17 03:49:12', 1),
(14, 'Mini cart above products', 'block_mini_cart_above_products', '<div style="padding:15px; background-color:#f5f5f5; color:#d90000;" title="Customizable CMS block for promo info">\r\n<a class="go" href="{{store url=""}}">Check our latest super promotions!</a>\r\n</div>', '2012-10-04 20:41:14', '2013-06-28 15:10:54', 0),
(15, 'Custom Tab 1', 'block_product_tab1', '<p>Custom CMS block displayed as a tab. You can use it to display info about returns and refunds, latest promotions etc. You can put your own content here: text, HTML, images - whatever you like. There are <strong>many similar blocks</strong> accross the store. All CMS blocks are editable from the admin panel.</p>\r\n\r\n<div class="feature indent first">\r\n	<span class="icon i-right no-bg-color"></span>\r\n	<p class="no-margin"><strong>Magento Community Edition is the most powerful</strong> open source e-commerce software and can be downloaded 100% for free. Developers can modify the core code, add custom features and functionality by installing extensions from Magento Connect marketplace.</p>\r\n</div>\r\n<div class="feature indent">\r\n	<span class="icon i-right no-bg-color"></span>\r\n	<p class="no-margin"><strong>Manage the fully dynamic catalog</strong> with the intutive admistrative interface. The flexible catalog system includes various options for the display of items. Magento is also integrated with a variety of major payment gateways out of the box.</p>\r\n</div>\r\n<div class="feature indent last">\r\n	<span class="icon i-right no-bg-color"></span>\r\n	<p class="no-margin"><strong>Magento is a fully global platform</strong>, allowing for the expansion of business or simply offering multiple versions of your site to meet the needs of your customers.\r\nTranslated into over 60 languages, supporting multiple currencies, payment methods and taxes, Magento allows for internationalization of your online stores.</p>\r\n</div>', '2012-10-04 20:41:15', '2014-02-04 01:54:35', 0),
(16, 'Custom Tab 2', 'block_product_tab2', '<p>Another custom CMS block displayed as a tab. You can use it to display info about returns and refunds, latest promotions etc. You can put your own content here: text, HTML, images - whatever you like. There are <strong>many similar blocks</strong> accross the store. All CMS blocks are editable from the admin panel.</p>\r\n\r\n<p>Lorem ipsum dolor sit, consectetur adipiscing elit. Etiam neque velit, blandit sed scelerisque quis. Nullam ornare enim nec justo bibendum lobortis. In eget metus.</p>', '2012-10-04 20:41:15', '2013-09-03 02:15:13', 0),
(17, 'Cart - below table', 'block_cart_below_table', '<div class="nested-container hide-below-768">\r\n\r\n    <div class="page-banners clearer">\r\n        <div class="grid12-6 banner">\r\n            <a href="{{store direct_url="about-magento-demo-store"}}" title="Static CMS block displayed below the cart. Put your own content here.">\r\n                <img src="{{media url="wysiwyg/infortis/ultimo/custom/banners/01.png"}}" alt="Sample banner" />\r\n            </a>\r\n        </div>\r\n        <div class="grid12-6 banner">\r\n            <a href="{{store direct_url="about-magento-demo-store"}}" title="Static CMS block displayed below the cart. Put your own content here.">\r\n                <img src="{{media url="wysiwyg/infortis/ultimo/custom/banners/02.png"}}" alt="Sample banner" />\r\n            </a>\r\n        </div>\r\n    </div>\r\n\r\n</div>', '2012-10-04 20:41:16', '2013-01-16 06:29:34', 1),
(18, 'Footer column 1', 'block_footer_column1', '<div class="collapsible mobile-collapsible">\r\n<h6 class="block-title heading">About Ultimo</h6>\r\n<div class="block-content">\r\n<div class="feature first last"><img class="icon" src="{{media url="wysiwyg/infortis/ultimo/icons/info.png"}}" alt="About Ultimo Magento Theme" />\r\n<h3><span style="font-family: arial, helvetica, sans-serif;">Madiwin&nbsp;is an electronic cigarette company specializing in offering premium cartridges and e-liquids of the top name brands such as Blu, NJOY, Green Smoke, Logic, and many more.</span></h3>\r\n<p>Suitable for every type of store. Great starting point for your custom projects.</p>\r\n<h5><a class="go" href="http://themeforest.net/item/ultimo-fluid-responsive-magento-theme/3231798?ref=infortis">Buy this theme</a></h5>\r\n</div>\r\n</div>\r\n</div>', '2012-10-04 20:41:16', '2014-02-08 23:59:14', 0),
(19, 'Footer column 2', 'block_footer_column2', '<div class="collapsible mobile-collapsible">\r\n	<h6 class="block-title heading">Key Features</h6>\r\n\r\n	<div class="block-content">\r\n\r\n		<div class="feature feature-icon-hover indent first">\r\n			<span class="icon i-number">1</span>\r\n			<p class="no-margin">Unlimited colors, dozens of customizable elements</p>\r\n		</div>\r\n		<div class="feature feature-icon-hover indent">\r\n			<span class="icon i-number">2</span>\r\n			<p class="no-margin ">Customizable responsive layout based on fluid grid</p>\r\n		</div>\r\n		<div class="feature feature-icon-hover indent">\r\n			<span class="icon i-number">3</span>\r\n			<p class="no-margin ">50+ placeholders to display custom content</p>\r\n		</div>\r\n		<div class="feature feature-icon-hover indent">\r\n			<span class="icon i-number">4</span>\r\n			<p class="no-margin ">Create your custom sub-themes (variants)</p>\r\n		</div>\r\n\r\n	</div>\r\n</div>', '2012-10-04 20:41:17', '2013-10-30 03:15:40', 0),
(20, 'Footer column 3', 'block_footer_column3', '<div class="collapsible mobile-collapsible">\r\n	<h6 class="block-title heading">Theme Features</h6>\r\n\r\n	<div class="block-content">\r\n	\r\n		<ul class="bullet">\r\n			<li><a href="{{store url=''ultimo-responsive-magento-theme''}}">Theme Features</a></li>\r\n			<li><a href="{{store url=''typography''}}">Typography</a></li>\r\n			<li><a href="#">Some Sample Link</a></li>\r\n			<li><a href="#">Meat Our Best Partners</a></li>\r\n			<li><a href="#">Latest Work Samples</a></li>\r\n			<li><a href="#">Our Other Projects</a></li>\r\n			<li><a href="#">One Click To Join Us</a></li>\r\n			<li><a href="#">Follow Us On Twitter</a></li>\r\n			<li><a href="http://infortis-themes.com/">Magento Themes</a></li>\r\n			<li><a href="#">Ecommerce</a></li>\r\n		</ul>\r\n\r\n	</div>\r\n</div>', '2012-10-04 20:41:17', '2013-10-30 03:15:43', 0),
(21, 'Footer column 4', 'block_footer_column4', '<div class="collapsible mobile-collapsible">\r\n	<h6 class="block-title heading">Company Info</h6>\r\n\r\n	<div class="block-content">\r\n\r\n		<div class="feature indent first">\r\n			<span class="icon i-telephone-w"></span>\r\n			<p class="no-margin ">Call Us (561) 265-5329<br/>Fax (561) 265-5329</p>\r\n		</div>\r\n		<div class="feature indent">\r\n			<span class="icon i-mobile-w"></span>\r\n			<p class="no-margin ">(917) 589-8114<br/>+42 98 9876</p>\r\n		</div>\r\n		<div class="feature indent">\r\n			<span class="icon i-letter-w"></span>\r\n			<p class="no-margin ">boss@example.com<br/>me@example.com</p>\r\n		</div>\r\n		<div class="feature indent last">\r\n			<span class="icon i-skype-w"></span>\r\n			<p class="no-margin ">Skype: samplelogin<br/>skype_support</p>\r\n		</div>\r\n\r\n	</div>\r\n</div>', '2012-10-04 20:41:18', '2014-02-06 00:24:37', 0),
(22, 'Footer column 5', 'block_footer_column5', '<div class="grid12-3">\r\n	<div class="collapsible mobile-collapsible">\r\n\r\n		<h6 class="block-title heading">Company Info</h6>\r\n		<div class="block-content">\r\n			<div class="feature feature-icon-hover indent first">\r\n				<span class="icon i-telephone-w"></span>\r\n				<p class="no-margin ">Call Us (561) 265-5329<br/>Fax (561) 265-5329</p>\r\n			</div>\r\n			<div class="feature feature-icon-hover indent">\r\n				<span class="icon i-mobile-w"></span>\r\n				<p class="no-margin ">(917) 589-8114</p>\r\n			</div>\r\n			<div class="feature feature-icon-hover indent">\r\n				<span class="icon i-letter-w"></span>\r\n				<p class="no-margin ">help@madiwin.com</p>\r\n			</div>\r\n			<div class="feature feature-icon-hover indent last">\r\n				<span class="icon i-skype-w"></span>\r\n				<p class="no-margin ">Skype: samplelogin<br/>skype-support</p>\r\n			</div>\r\n		</div>\r\n\r\n	</div>\r\n</div>\r\n\r\n<div class="grid12-3">\r\n<div class="collapsible mobile-collapsible">\r\n<h6 class="block-title heading">My Account</h6>\r\n<div class="block-content">\r\n<ul class="bullet">\r\n<li><a href="{{store url=''customer/account/login/''}}">Log In/Register</a></li>\r\n<li><a href="#">My Account</a></li>\r\n<li><a href="#">My Order History</a></li>\r\n<li><a href="#">Refer a Friend</a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class="collapsible mobile-collapsible">\r\n<h6 class="block-title heading">Follow Us</h6>\r\n<div class="block-content">\r\n<ul class="bullet">\r\n<li><a href="{{store url=''ultimo-responsive-magento-theme''}}">Facebook</a></li>\r\n<li><a href="{{store url=''typography''}}">Twitter</a></li>\r\n<li><a href="#">Blog</a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="grid12-3">\r\n<div class="collapsible mobile-collapsible">\r\n<h6 class="block-title heading">Support</h6>\r\n<div class="block-content">\r\n<ul class="bullet">\r\n<li><a href="{{store url=''private-policy/?___store=default''}}">Privacy Policy</a></li>\r\n<li><a href="customer-service/?___store=default">Customer Service</a></li>\r\n<li><a href="customer-service/?___store=default">Shipping</a></li>\r\n<li><a href="customer-service/?___store=default">Refund</a></li>\r\n<li><a href="customer-service/?___store=default">Contact Us</a></li>\r\n<li><a href="faq/?___store=default">FAQ''s</a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="grid12-3">\r\n<div class="collapsible mobile-collapsible">\r\n<h6 class="block-title heading">About Madiwin</h6>\r\n<div class="block-content">\r\n<div class="feature first last"><img class="icon" src="{{media url="wysiwyg/infortis/ultimo/icons/info.png"}}" alt="About Ultimo Magento theme" />\r\n<p>Madiwin is an electronic cigarette company specializing in offering premium cartridges and e-liquids of the top name brands such as Blu, NJOY, Green Smoke, Logic, and many more.</p>\r\n<p>Our philosophy is to keep our overhead down and pass the saving to our value customers.</p>\r\n<h5><a class="go" href="http://themeforest.net/item/ultimo-fluid-responsive-magento-theme/3231798?ref=infortis">Read More</a></h5>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '2012-10-04 20:41:18', '2014-02-14 02:28:19', 1),
(23, 'Footer column 6', 'block_footer_column6', '<h6 class="heading">Sample Column</h6>\r\n<ul>\r\n<li><a href="#">Responsive Magento Theme</a></li>\r\n<li><a href="#">Magento Extensions</a></li>\r\n<li><a href="#">Store Overview</a></li>\r\n<li><a href="#">Buy This</a></li>\r\n<li><a href="#">Sample Link</a></li>\r\n<li><a href="#">Some Other Link</a></li>\r\n<li><a href="#">Link Example</a></li>\r\n</ul>', '2012-10-04 20:41:19', '2012-11-18 03:20:47', 0),
(24, 'Support', 'block_header_nav_dropdown', '<div class="grid12-3">\r\n\r\n	<h2 class="heading">Responsive Magento Theme</h2>\r\n	<p>Ultimo is a premium Magento theme with advanced admin module. It''s extremely customizable and fully responsive. Can be used for every type of store.</p>\r\n	<h5><a class="go" href="http://themeforest.net/item/ultimo-fluid-responsive-magento-theme/3231798?ref=infortis" style="color:red;">Buy this Magento theme</a></h5>\r\n\r\n</div>\r\n<div class="grid12-3">\r\n\r\n	<img src="{{media url=''wysiwyg/infortis/ultimo/menu/custom/01.png''}}" alt="Magento CMS blocks" />\r\n	<h4 class="heading">50+ CMS blocks</h4>\r\n	<p>You can use CMS blocks as content placeholders to display custom content in almost every part of the store. Import sample CMS blocks from the demo.</p>\r\n	<a href="{{store url=''ultimo-responsive-magento-theme''}}" class="go">See all features</a>\r\n\r\n</div>\r\n<div class="grid12-3">\r\n\r\n	<img src="{{media url=''wysiwyg/infortis/ultimo/menu/custom/02.png''}}" alt="Magento theme documentation" />\r\n	<h4 class="heading">140-pages documentation</h4>\r\n	<p>The best Magento theme documentation on ThemeForest. It also describes selected Magento features which you need to know when starting to work with Magento.</p>\r\n	<a href="{{store url=''ultimo-responsive-magento-theme''}}" class="go">See all features</a>\r\n\r\n</div>\r\n<div class="grid12-3">\r\n\r\n	<img src="{{media url=''wysiwyg/infortis/ultimo/menu/custom/03.png''}}" alt="Create Magento sub-themes" />\r\n	<h4 class="heading">Easy to customize</h4>\r\n	<p>Use Ultimo as a starting point for your custom projects. Unlike many other themes, Ultimo lets you create multiple custom sub-themes (theme variants) for your clients.</p>\r\n	<a href="{{store url=''ultimo-responsive-magento-theme''}}" class="go">See all features</a>\r\n\r\n</div>', '2012-10-04 20:41:19', '2014-02-12 01:21:39', 1),
(25, 'CMS page top', 'block_cms_page_top', '<div class="nested-container">\r\n\r\n    <div class="page-banners clearer">\r\n        <div class="grid12-6 banner">\r\n            <a href="{{store direct_url="about-magento-demo-store"}}" title="Replace this image with your own">\r\n                <img src="{{media url="wysiwyg/infortis/ultimo/custom/banners/01.png"}}" alt="Sample banner" />\r\n            </a>\r\n        </div>\r\n        <div class="grid12-6 banner">\r\n            <a href="{{store direct_url="about-magento-demo-store"}}" title="Replace this image with your own">\r\n                <img src="{{media url="wysiwyg/infortis/ultimo/custom/banners/02.png"}}" alt="Sample banner" />\r\n            </a>\r\n        </div>\r\n\r\n    </div>\r\n\r\n</div>', '2012-10-04 20:41:20', '2013-01-15 19:19:32', 0),
