(50, 'Home slide 3', 'block_slide3', '<a href="{{store url=''about-magento-demo-store''}}">\r\n	<img src="{{media url=''wysiwyg/infortis/ultimo/slideshow/03.jpg''}}" alt="Sample slide" />\r\n\r\n		<div class="caption dark3">\r\n			<h2 class="heading permanent">Sample Caption</h2>\r\n			<p>Etiam neque velit, blandit sed scelerisque quis. Lorem ipsum.</p>\r\n			<p>Lorem ipsum dolor sit amet consectetur</p>\r\n		</div>\r\n\r\n		<div class="caption dark1 top-right">\r\n			<h2 class="heading permanent">Sample Caption</h2>\r\n			<p>Nullam ornare enim nec justo bibendum lobortis metus</p>\r\n		</div>\r\n\r\n</a>', '2012-11-13 22:53:33', '2013-04-06 15:21:00', 1),
(51, 'Demo landing page 1', 'demo_landing_page1', '<div class="landing-page nested-container">\r\n	<br />\r\n    \r\n	<div class="vertical-section grid12-4 mobile-grid-half">\r\n        <a href="{{store direct_url="downloadable/ebooks.html"}}">\r\n        	<img class="center-block" src="{{media url="wysiwyg/infortis/ultimo/custom/landing/blucarts.jpeg"}}" alt="Sample banner" />\r\n            <div class="caption dark3 full-width">\r\n                <h2 class="heading permanent">e-Books</h2>\r\n                <p class="permanent">Sell e-Books with Magento</p>\r\n                <p>Lorem ipsum dolor </p>\r\n            </div>\r\n        </a>\r\n	</div>\r\n	<div class="vertical-section grid12-4 mobile-grid-half">\r\n        <a href="{{store direct_url="downloadable/music.html"}}">\r\n        	<img class="center-block" src="{{media url="wysiwyg/infortis/ultimo/custom/landing/vert2.jpg"}}" alt="Sample banner" />\r\n            <div class="caption dark3 full-width">\r\n	            <h2 class="heading permanent">Music</h2>\r\n    	        <p class="permanent">Sell music with Magento</p>\r\n        	    <p>Lorem ipsum dolor </p>\r\n            </div>\r\n        </a>\r\n	</div>\r\n	<div class="vertical-section grid12-4 mobile-grid-half">\r\n        <a href="{{store direct_url="downloadable/software.html"}}">\r\n        	<img class="center-block" src="{{media url="wysiwyg/infortis/ultimo/custom/landing/vert3.jpg"}}" alt="Sample banner" />\r\n            <div class="caption dark3 full-width">\r\n	            <h2 class="heading permanent">Software</h2>\r\n    	        <p class="permanent">Sell digital products</p>\r\n        	    <p>Lorem ipsum dolor </p>\r\n            </div>\r\n        </a>\r\n	</div>\r\n\r\n\r\n	<div class="vertical-section grid-full mobile-grid-half">\r\n		<p class="horizontal-section" style="background-color: #f5f5f5; padding: 15px;">This is a custom landing page: a CMS block which can replace category products. You can put your own content here: text, HTML, images - whatever you want. You can create landing page for every category.</p>\r\n	</div>\r\n	<br />\r\n\r\n    \r\n	<div class="vertical-section grid-full">\r\n		{{block type="ultimo/product_list_featured" category_id="58" product_count="16" show_items="5" is_responsive="1" centered="1" size="size-s" move="2" hide_button="1" block_name="See Also: Recommended New Products" template="catalog/product/list_featured_slider.phtml"}}\r\n	</div>\r\n</div>', '2012-11-14 00:13:10', '2014-02-11 13:11:44', 1),
(52, 'Demo landing page 2', 'demo_landing_page2', '<div class="landing-page">\r\n\r\n	<p class="horizontal-section sample-block">This is a custom landing page with sidebar: a CMS block which can replace category products. You can put your own content here: text, HTML, images - whatever you want. You can create landing page for every category.</p>\r\n\r\n	<a class="horizontal-section" href="{{store direct_url="about-magento-demo-store"}}" title="Replace this image with your own content.">\r\n		<img src="{{media url="wysiwyg/infortis/ultimo/custom/landing/horiz1.jpg"}}" alt="Sample Image" />\r\n	</a>\r\n\r\n	<a class="horizontal-section" href="{{store direct_url="about-magento-demo-store"}}" title="Replace this image with your own content.">\r\n		<img src="{{media url="wysiwyg/infortis/ultimo/custom/landing/horiz2.jpg"}}" alt="Sample Image" />\r\n	</a>\r\n\r\n	<a class="horizontal-section" href="{{store direct_url="about-magento-demo-store"}}" title="Replace this image with your own content.">\r\n		<img src="{{media url="wysiwyg/infortis/ultimo/custom/landing/horiz3.jpg"}}" alt="Sample Image" />\r\n	</a>\r\n\r\n</div>', '2012-11-14 00:23:14', '2012-11-14 00:23:14', 1),
(53, 'Demo landing page 3 - category 1', 'demo_landing_page3', '<div class="horizontal-section">\r\n\r\n	<a href="#">\r\n		<img src="{{media url="wysiwyg/infortis/ultimo/custom/landing/category01.jpg"}}" title="You can edit this block or replace it with custom content" alt="Sample banner" />\r\n    \r\n		<div class="caption light3 full-width">\r\n			<h2 class="heading permanent">Category Banner</h2>\r\n			<p>Upload image and description for every category in the store</p>\r\n			<p>Create landing pages for categories</p>\r\n		</div>\r\n	</a>\r\n    \r\n</div>', '2012-11-14 00:35:29', '2013-03-24 19:29:44', 1),
(54, 'Demo landing page 4 - category 2', 'demo_landing_page4', '<div class="horizontal-section">\r\n\r\n	<a href="#">\r\n		<img src="{{media url="wysiwyg/infortis/ultimo/custom/landing/category02.jpg"}}" title="You can edit this block or replace it with custom content" alt="Sample banner" />\r\n    \r\n		<div class="caption light2 full-width">\r\n			<h2 class="heading permanent">Category Banner</h2>\r\n			<p>Upload image and description for every category in the store</p>\r\n			<p>Create landing pages for categories</p>\r\n		</div>\r\n	</a>\r\n    \r\n</div>', '2012-11-14 14:55:43', '2013-03-24 19:30:01', 1),
