(56, 'Demo slide - s1 wide - 1', 'demo_slide_s1-wide_1', '<img src="{{media url="wysiwyg/demo/infortis/ultimo/slideshow/s2_1.jpg"}}" alt="Theme For Wide Screens" />\r\n\r\n		<div class="caption light3 full-width">\r\n			<h2 class="heading permanent">Theme For Wide Screens</h2>\r\n			<p>Ultimo Theme fully supports wide screens</p>\r\n		</div>', '2012-11-18 03:04:54', '2013-09-03 19:41:41', 1),
(57, 'Slideshow banners', 'block_slideshow_banners', '<a class="banner" href="{{store url=''about-magento-demo-store''}}">\r\n	<img src="{{media url=''wysiwyg/infortis/ultimo/slideshow/banner/01.png''}}" alt="Sample banner" />\r\n\r\n	<div class="caption light1 full-width right">\r\n		<p class="right">Sample caption</p>\r\n	</div>\r\n\r\n</a>\r\n\r\n<a class="banner" href="{{store url=''about-magento-demo-store''}}">\r\n	<img src="{{media url=''wysiwyg/infortis/ultimo/slideshow/banner/02.png''}}" alt="Sample banner" />\r\n\r\n	<div class="caption dark1 full-width right">\r\n		<p class="right">Add custom text</p>\r\n	</div>\r\n\r\n</a>\r\n\r\n<a class="banner" href="{{store url=''about-magento-demo-store''}}">\r\n	<img src="{{media url=''wysiwyg/infortis/ultimo/slideshow/banner/03.png''}}" alt="Sample banner" />\r\n\r\n	<div class="caption dark3 full-width right">\r\n		<p class="right">Simple example</p>\r\n	</div>\r\n</a>', '2013-01-05 15:12:56', '2013-02-22 15:11:38', 1),
(58, 'Demo slideshow banners - s1', 'demo_slideshow_banners_s1', '<p><a class="banner fade-on-hover" title="Go to ThemeForest marketplace to buy this theme" href="http://themeforest.net/item/ultimo-fluid-responsive-magento-theme/3231798?ref=infortis"> <img src="{{media url=''wysiwyg/demo/infortis/ultimo/slideshow/banner/s1/01.jpg''}}" alt="Buy This Theme" /></a></p>\r\n<div class="caption light1 full-width right">\r\n<p class="right">Buy This Theme</p>\r\n</div>\r\n<p><a class="banner fade-on-hover" title="Click to see a list of all demos of this  Magento theme" href="http://ultimo.infortis-themes.com/demo/select-demo/"> <img src="{{media url=''wysiwyg/demo/infortis/ultimo/slideshow/banner/s1/02.jpg''}}" alt="List of all demos" /></a></p>\r\n<div class="caption dark1 full-width right">\r\n<p class="right">See All Demos</p>\r\n</div>\r\n<p><a class="banner fade-on-hover" title="Sell downloads in your Magento store (software, e-books, music, any digital products)" href="{{store direct_url=''downloadable/ebooks.html''}}"> <img src="{{media url=''wysiwyg/demo/infortis/ultimo/slideshow/banner/s1/03.jpg''}}" alt="Sell Downloads" /></a></p>\r\n<div class="caption light1 full-width right">\r\n<p class="right">Sell Downloads</p>\r\n</div>', '2013-01-06 00:05:29', '2014-01-27 21:49:42', 0),
(60, 'Home page - preface', 'block_home_preface', '<span class="section-line"></span>\r\n<br/>\r\n<div class="grid12-3">\r\n\r\n	<div class="feature feature-icon-hover large">\r\n		<span class="icon large">\r\n			<img src="{{media url=''wysiwyg/infortis/ultimo/icons/large/paintbrush.png''}}" />\r\n		</span>\r\n		<h6 class="above-heading">Customizable design</h6>\r\n		<h3>Unlimited Colors</h3>\r\n		<p>You have never seen so many options! Change colors of dozens of elements, apply textures, upload background images...</p>\r\n		<a href="{{store url=''ultimo-responsive-magento-theme''}}" class="go">See all features</a>\r\n	</div>\r\n\r\n</div>\r\n<div class="grid12-3">\r\n\r\n	<div class="feature feature-icon-hover large">\r\n		<span class="icon large">\r\n			<img src="{{media url=''wysiwyg/infortis/ultimo/icons/large/responsive.png''}}" />\r\n		</span>\r\n		<h6 class="above-heading">12-column grid</h6>\r\n		<h3>Responsive Layout</h3>\r\n		<p>Ultimo can be displayed on any screen. It is based on fluid grid system. If screen is resized, layout will be automatically adjusted...</p>\r\n		<a href="{{store url=''ultimo-responsive-magento-theme''}}" class="go">See all features</a>\r\n	</div>\r\n\r\n</div>\r\n<div class="grid12-3">\r\n\r\n	<div class="feature feature-icon-hover large">\r\n		<span class="icon large">\r\n			<img src="{{media url=''wysiwyg/infortis/ultimo/icons/large/menu.png''}}" />\r\n		</span>\r\n		<h6 class="above-heading">Customizable drop-down menu</h6>\r\n		<h3>Mega Menu</h3>\r\n		<p>Two styles: wide mega menu or classic drop-down menu. You can add any custom content (images, text, HTML) to any category in the catalog...</p>\r\n		<a href="{{store url=''ultimo-responsive-magento-theme''}}" class="go">See all features</a>\r\n	</div>\r\n\r\n</div>\r\n<div class="grid12-3">\r\n\r\n	<div class="feature feature-icon-hover large">\r\n		<span class="icon large">\r\n			<img src="{{media url=''wysiwyg/infortis/ultimo/icons/large/star.png''}}" />\r\n		</span>\r\n		<h6 class="above-heading">Content placeholders</h6>\r\n		<h3>50+ CMS blocks</h3>\r\n		<p>You can use content placeholders to display custom content in almost every part of the store. Import sample CMS blocks from the demo...</p>\r\n		<a href="{{store url=''ultimo-responsive-magento-theme''}}" class="go">See all features</a>\r\n	</div>\r\n\r\n</div>\r\n<div class="clearer"></div>\r\n<br/>\r\n<span class="section-line"></span>\r\n<br/>\r\n<br/>', '2013-01-14 02:23:04', '2014-01-23 00:54:25', 1),
(61, 'Home page - left 2', 'block_home_left2', '<div class="block">\r\n	<div class="block-title">\r\n		<strong><span>Home Custom Block</span></strong>\r\n	</div>\r\n\r\n	<p style="background-color: #f5f5f5; color:#666; padding:10px; margin-bottom:10px; margin-top:10px;">\r\n		Custom CMS block displayed at the left sidebar on the home page. Put your own content here: text, HTML, images - whatever you like.\r\n	</p>\r\n	<p style="background-color: #f5f5f5; color:#666; padding:10px;">\r\n		There are many similar content placeholders across the store. All editable from admin panel.\r\n	</p>\r\n</div>', '2013-01-14 02:27:19', '2014-01-30 03:57:39', 0),
(62, 'Home page - left 1', 'block_home_left1', '{{block type="ultramegamenu/navigation" template="infortis/ultramegamenu/categories.phtml"}}', '2013-01-14 02:27:25', '2013-09-22 22:15:29', 0),
