(69, 'Header top right 2', 'block_header_top_right2', '<div class="dropdown lang-switcher item"  title="Multiple languages are supported. This is only a demo switcher so it doesn''t switch languages.">\r\n\r\n	<div class="dropdown-toggle cover">\r\n		<div>\r\n			<div style="background-image:url({{skin url=''images/flags/default.png''}})" class="label dropdown-icon flag">&nbsp;</div>\r\n			<div class="value">English</div>\r\n			<div class="caret">&nbsp;</div>\r\n		</div>\r\n	</div>\r\n    \r\n	<ul class="dropdown-menu left-hand">\r\n		<li class="current">\r\n			<span style="background-image:url({{skin url=''images/flags/default.png''}});" class="label dropdown-icon">&nbsp;</span>English</li>\r\n		<li>\r\n			<a href="#"><span style="background-image:url({{skin url=''images/flags/default_de.png''}});" class="label dropdown-icon">&nbsp;</span>German</a>\r\n		</li>\r\n		<li>\r\n			<a href="#"><span style="background-image:url({{skin url=''images/flags/it.png''}});" class="label dropdown-icon">&nbsp;</span>Italian</a>\r\n		</li>\r\n		<li>\r\n			<a href="#"><span style="background-image:url({{skin url=''images/flags/fr.png''}});" class="label dropdown-icon">&nbsp;</span>French</a>\r\n		</li>\r\n	</ul>\r\n\r\n</div>', '2013-01-15 23:09:52', '2013-05-31 21:18:36', 1),
