(72, 'Demo slide - all - 2', 'demo_slide_all_2', '<a href="{{store url=''ultimo-responsive-magento-theme''}}">\r\n   <img src="{{media url="wysiwyg/demo/infortis/ultimo/slideshow/all_2.jpg"}}" alt="Sample slide" />\r\n\r\n		<div class="caption light1 bottom-right">\r\n			<h2 class="heading permanent">Configure Product Grid</h2>\r\n			<p>Customize the display of category grid, show/hide elements</p>\r\n			<p>Show products in columns: from 2 to 7</p>\r\n		</div>\r\n\r\n</a>', '2013-01-17 01:08:36', '2013-04-06 14:09:46', 1),
