INSERT INTO `cms_page` (`page_id`, `title`, `root_template`, `meta_keywords`, `meta_description`, `identifier`, `content_heading`, `content`, `creation_time`, `update_time`, `is_active`, `sort_order`, `layout_update_xml`, `custom_theme`, `custom_root_template`, `custom_layout_update_xml`, `custom_theme_from`, `custom_theme_to`) VALUES
(12, 'Ultimo - Responsive Magento Theme | Download', 'two_columns_right', NULL, NULL, 'ultimo-responsive-magento-theme', 'Ultimo - Responsive Magento Theme', '<p>Ultimo is a premium Magento theme with advanced admin module. It’s extremely customizable, easy to use and fully responsive. Suitable for every type of store. Great as a starting point for your custom projects.</p>\r\n\r\n<h4><a style="color:red;" class="go" href="http://themeforest.net/item/ultimo-fluid-responsive-magento-theme/3231798?ref=infortis">Buy this theme</a></h4>\r\n\r\n<h4><a class="go" href="http://ultimo.infortis-themes.com/demo/select-demo/" title="See more demos">See all available demos</a></h4>\r\n\r\n<br/>\r\n\r\n\r\n<span class="section-line"></span>\r\n<br/>\r\n<div class="grid12-4">\r\n\r\n	<div class="feature feature-icon-hover large">\r\n		<span class="icon large">\r\n			<img src="{{media url="wysiwyg/infortis/ultimo/icons/large/paintbrush.png"}}" alt="sample icon" />\r\n		</span>\r\n		<h6 class="above-heading">Customizable design</h6>\r\n		<h3>Unlimited Colors</h3>\r\n		<p>You have never seen so many options! Change colors of dozens of elements, apply textures, upload background images...</p>\r\n	</div>\r\n\r\n</div>\r\n<div class="grid12-4">\r\n\r\n	<div class="feature feature-icon-hover large">\r\n		<span class="icon large">\r\n			<img src="{{media url="wysiwyg/infortis/ultimo/icons/large/responsive.png"}}" alt="sample icon" />\r\n		</span>\r\n		<h6 class="above-heading">12-column grid</h6>\r\n		<h3>Responsive Layout</h3>\r\n		<p>Ultimo can be displayed on any screen. It is based on fluid grid system. If screen is resized, layout will be automatically adjusted to the current resolution...</p>\r\n	</div>\r\n\r\n</div>\r\n<div class="grid12-4">\r\n\r\n	<div class="feature feature-icon-hover large">\r\n		<span class="icon large">\r\n			<img src="{{media url="wysiwyg/infortis/ultimo/icons/large/menu.png"}}" alt="sample icon" />\r\n		</span>\r\n		<h6 class="above-heading">Customizable mega menu</h6>\r\n		<h3>Mega Menu</h3>\r\n		<p>Two styles: wide mega menu or classic drop-down menu. You can add any custom content (images, text, HTML) to any category in the catalog...</p>\r\n\r\n	</div>\r\n\r\n</div>\r\n<div class="clearer"></div>\r\n\r\n\r\n\r\n<span class="section-line"></span>\r\n<br/>\r\n<h2>List of key features</h2>\r\n\r\n<br/>\r\n<h4>DESIGN</h4>\r\n<ul class="bullet">\r\n	<li><strong>Customizable design</strong> - change the visual appearance of almost every element</li>\r\n	<li><strong>Unlimited colors</strong> - change colors, apply textures, upload custom background image</li>\r\n</ul>\r\n\r\n\r\n<br/>\r\n<h4>LAYOUT</h4>\r\n<ul class="bullet">\r\n	<li><strong>Customizable responsive layout</strong> - custom maximum width of the page, supports wide screens</li>\r\n	<li><strong>Fluid grid system</strong> (12-column) - the theme always uses maximum available width of the screen to display content. It can be displayed on any screen. Fluid width can be disabled</li>\r\n</ul>\r\n\r\n\r\n<br/>\r\n<h4>MENU</h4>\r\n<ul class="bullet">\r\n	<li><strong>2 menu styles - </strong>wide mega menu [<a href="http://ultimo.infortis-themes.com/demo/">demo</a>] or classic drop-down menu [<a href="http://ultimo.infortis-themes.com/demo/third/">demo</a>]</li>\r\n	<li><strong>Custom content blocks</strong> - add any content (images, text, HTML) inside category drop-down menu, for every 1st-level and 2nd-level category</li>\r\n	<li><strong>Customizable size</strong> - adjust number of columns inside drop-down menu</li>\r\n	<li><strong>Accordion</strong> - on mobile devices menu turns into collapsible accordion</li>\r\n	<li><strong>Sidebar menu</strong> - display menu (categories) in the sidebars and in any custom block</li>\r\n	<li><strong>Category labels</strong> - eye-catching labels for categories</li>\r\n	<li><strong>Fully customizable colors</strong></li>\r\n</ul>\r\n\r\n\r\n<br/>\r\n<h4>CATEGORY VIEW</h4>\r\n<ul class="bullet">\r\n	<li><strong>Fluid products grid - </strong>display from 2 to 7 columns of products on category pages. On wide screens the number of columns will be automatically increased to show more products in a row</li>\r\n	<li><strong>Customizable grid</strong> - configure the display of the following elements (they can be visible, visible only on mouse hover, or completely removed): "Add to cart" button, ratings (stars), "Add to wishlist" and "Add to compare" links</li>\r\n	<li><strong>Alternative images</strong> - show alternative product image on mouse hover in category view and in the home page product sliders</li>\r\n	<li><strong>Equal height</strong> of items in the category grid (can be enabled/disabled)</li>\r\n	<li><strong>Keep the aspect ratio</strong> of product images on category pages</li>\r\n	<li><strong>List of categories</strong> - block at the top of the left sidebar. It can be hidden on mobile devices. List of categories can also be displayed in CMS blocks and on CMS pages</li>\r\n</ul>\r\n\r\n\r\n<br/>\r\n<h4>PRODUCT PAGE</h4>\r\n<ul class="bullet">\r\n	<li><strong>Brand logo</strong> on product page. Logo can be a link to any page (to category with products from that brand, to search results or to any CMS page). Alternatively brand names (simple text) can be displayed instead of logo images</li>\r\n	<li><strong>Customizable image size</strong> on product page. Specify any size you like, images don’t have to be square - you can keep the aspect ratio</li>\r\n	<li><strong>Cloud Zoom + Lightbox</strong> to enlarge product images. Use one of those methods or both at a time</li>\r\n	<li><strong>Image gallery</strong> - enable/disable gallery mode in the Lightbox</li>\r\n	<li><strong>Tabs/accordion </strong><strong>- </strong>tabs smoothly turns into accordion on lower screen resolutions</li>\r\n	<li><strong>"Additional Information" tab for individual product attributes </strong>- create and display custom product attributes</li>\r\n	<li><strong>2 tabs for custom content</strong> - ready to display any static content: info about shipping, returns, sales, promotions or any other general information</li>\r\n	<li><strong>Tabbed reviews</strong> - show product reviews on product page to improve SEO</li>\r\n	<li><strong>Replace Related Products and Up-sell Products</strong> blocks with custom content. Replace completely or replace only if the product does not have any related/up-sell products. Or disable those blocks completely with just one click</li>\r\n	<li><strong>Product sliders</strong> for Up-sell Products and Related Products. Now you can select as much related and up-sell products as you want</li>\r\n</ul>\r\n\r\n\r\n<br/>\r\n<h4>HOME PAGE</h4>\r\n<ul class="bullet">\r\n	<li><strong>Home page slideshow</strong> - fully customizable, easy to use. "Slide" or "fade" effect, 30 easing methods, editable speed of movement and speed of transition and much more. Display any content in your slides (clickable or non-clickable images, complex HTML, anything), add captions above images</li>\r\n	<li><strong>Slideshow + banners</strong> - additional banners (can be disabled) at the right or left side of the slideshow.</li>\r\n	<li><strong>Hide slideshow on mobiles</strong> - ability to hide slideshow or slideshow banners on mobile devices</li>\r\n	<li><strong>1, 2, 3 columns layout</strong> - you can choose the layout of the home page: 1, 2 or 3 columns. Display custom content in multiple sidebar blocks. Enable/disable Magento’s default sidebar blocks on home page.</li>\r\n	<li><strong>List of categories</strong> - display block with the list of all categories in one of the sidebars</li>\r\n	<li><strong>Brand slider</strong> - present all brands on the home page (or on any other CMS page or sidebar block)</li>\r\n	<li><strong>"Featured Products" slider</strong> - display selected products on any page. Configure the number of products, scrolling speed, automatic or manual scrolling, number of items that should move on animation, ability to hide "Add to cart" buttons</li>\r\n	<li><strong>Multiple sliders</strong> - display multiple "Featured Products" sliders. Sliders can also be displayed on other CMS pages and inside sidebar CMS blocks</li>\r\n	<li><strong>Random products</strong> - display random products in the slider</li>\r\n	<li><strong>"New Products" slider </strong>- automatically display products marked as "new". It can be displayed on any page. Configure the number of products, scrolling speed, automatic or manual scrolling</li>\r\n	<li><strong>Responsive image banners</strong> - display columns of banners using fluid grid system</li>\r\n</ul>\r\n\r\n\r\n<br/>\r\n<h4>CMS</h4>\r\n<ul class="bullet">\r\n	<li><strong>One-click import</strong> - import CMS blocks and pages with sample content from the demo</li>\r\n	<li><strong>50+ CMS blocks</strong> - content placeholders ready to display custom content (in almost every part of the store). Using these  placeholders you are able to insert your content into product page, shopping cart, checkout, header, footer, CMS pages etc. Everything edited from the admin panel</li>\r\n	<li><strong>Large footer block</strong> with 2 rows of columns (from 1 to 6 columns in a row) for custom content. Put there your links, latest news or any other content</li>\r\n	<li><strong>Social services bookmarks</strong> can be easily placed on the product page using one of the CMS blocks</li>\r\n</ul>\r\n\r\n\r\n<br/>\r\n<h4>OTHER</h4>\r\n<ul class="bullet">\r\n	<li><strong>"New" and "Sale" labels</strong> - mark your products with eye-catching labels. Text on the labels can be translated</li>\r\n	<li><strong>Override default Magento header and footer links</strong> - those links are hard-coded in Magento but with this theme you can easily replace them with your custom links!</li>\r\n</ul>\r\n\r\n\r\n\r\n<br/>\r\n<h2>General info</h2>\r\n<ul class="bullet">\r\n	<li><strong>140-pages user guide PDF</strong> - the best Magento theme documentation<br />\r\non ThemeForest</li>\r\n	<li><strong>Multi-language ready</strong> - this theme can work with any language installed in your Magento</li>\r\n	<li><strong>Multi-store ready</strong> - applicable for multi-store Magento installations. In multi-store installations <strong>multiple licences are required (one regular licence for each store)</strong>.</li>\r\n	<li><strong>Performance</strong> - images are merged into CSS sprites. This method is proven to greatly reduce the amount of HTTP request and <strong>significantly improve page load time</strong></li>\r\n    <li>Optimized, well-structured and commented CSS</li>\r\n	<li>PSD files included (with basic layout structure + all interface icons for easy customization)</li>\r\n</ul>\r\n\r\n\r\n\r\n<br/>\r\n<h4><a style="color:red;" class="go" href="http://themeforest.net/item/ultimo-fluid-responsive-magento-theme/3231798?ref=infortis">Buy this theme</a></h4>', '2012-10-21 22:35:06', '2013-08-05 01:31:51', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
